(15, 7, '', '¡HURRA!', 'ihurra', 0, 273, 0, '', '', '2011-05-13 17:20:14', 0, 0, '0000-00-00 00:00:00', '', '<center><b>¡HURRA!</b></center>\r\n<center>¡Ya estamos en Línea!</center>', 41, '', 1, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(16, 7, '', 'MADRES', 'madres', 0, 268, 18, '', 'http://opp/opp/phocadownload/diamadres.pdf', '2011-05-16 16:41:44', 0, 0, '0000-00-00 00:00:00', '', '<center><b>¡Feliz día Madres!</b></center>\r\n<div align=\"justify\">La Gran Familia de la Oficina de Planificación y Presupuesto les desea muchas felicidades a todas las Madres en su día (<a href=\"{CLICKURL}\" target=\"_blank\">Ver tarjeta</a>).</div>', 41, '', 1, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(17, 7, '', 'Visita Nuestra Galería de Imágenes', 'visita', 0, 5022, 0, '', '', '2011-07-07 07:54:41', 0, 0, '0000-00-00 00:00:00', '', '<center><b>¡Visita Nuestra Galería de Imágenes!</b></center>', 41, '', 1, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(18, 7, '', 'Foro', 'foro', 0, 3493, 33, '', 'http://opp/opp/index.php?option=com_kunena&view=entrypage&defaultmenu=75&Itemid=73', '2011-06-02 15:15:24', 0, 0, '0000-00-00 00:00:00', '', '<center><b>¡Visita Nuestro Foro!</b></center>\r\n<div align=\"justify\">Podrás realizar preguntas y encontrar respuestas a interrogantes sobre temas de Formulación y Ejecución de Planes y Presupuesto.</div>\r\n<div align=\"justify\">MENÚ PRINCIPAL><a href=\"{CLICKURL}\" target=\"_self\">Foro</a></div>', 41, '', 0, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(19, 7, '', 'Eventos', 'visita', 0, 2792, 0, '', '', '2011-07-07 15:09:31', 0, 0, '0000-00-00 00:00:00', '', '<center><b>¡Visita Eventos del Dia!</b></center>', 41, '', 1, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(20, 8, '', 'Scroll', 'scroll', 0, 12813, 0, '', '', '2011-10-27 15:50:36', 1, 0, '0000-00-00 00:00:00', '', '<MARQUEE SCROLLAMOUNT=\"4\" ><b>\r\nAmigo funcionario recuerda contribuir con el ahorro de energía. El SENIAT en el camino de la Revolución.</b>\r\n</MARQUEE>', 45, '', 0, 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(21, 7, '', 'Validación de Usuarios', 'validacion-de-usuarios', 0, 5136, 0, '', '', '2011-11-01 20:41:07', 1, 72, '2011-11-01 20:41:07', '', '<center><b>La OPP informa que para el uso de los sistemas internos deberán validarse desde este portal</b></center>', 41, '', 1, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0'),
(22, 7, '', 'SIGME DE PRUEBA', 'sigme-de-prueba', 0, 4147, 165, '', 'http://opp/opp_new/modulos/ejecucion/sigme_des/modulos/login/index.php', '2011-11-03 21:12:48', 0, 0, '0000-00-00 00:00:00', '', '<br></br>\r\n<center><b>SIGME DE PRUEBA</b></center>\r\n<div align=\"justify\">Para acceder al Sigme de Prueba presione (<a href=\"{CLICKURL}\" target=\"_blank\">Aquí</a>).</div>', 41, '', 1, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'width=0\nheight=0');
