INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(58, '¡Más publicidad para el Nuevo Portal!', 'mas-publicidad', '', '<p style=\"text-align: justify;\">Mediante el INFOSENIAT Nº 1041 (Corregido) (<a href=\"phocadownload/INFOSENIAT_1041.pdf\" target=\"_blank\">Ver Aquí</a>) la Oficina de Planificación y Presupuesto nuevamente se complace en informar la creación de su portal contenido. Este nuevo Portal Web fue creado por la Coordinación de Informática de esta Oficina con la asistencia de la Gerencia General de Tecnología de Información y Comunicaciones, debidamente aprobado por el ciudadano Superintendente Nacional Aduanero y Tributario, y está a la disposición de las dependencias del Servicio para facilitar los procesos correspondientes a las competencias de esta Oficina.</p>\r\n', '\r\n<p>Cualquier duda u observación en pro del mejoramiento de este portal de contenido por favor comunicarse:<br /><br />Ing. Carlos M. Delfín A.<br />Coordinador de Informática<br />0212-2744612<br />0416-9301470<br />cdelfin@seniat.gob.ve<br />delfincarlos82@hotmail.com</p>\r\n<p>Jose R. García V.<br />0212-2744074<br />jgarciav@seniat.gob.ve<br />josegarciav@hotmail.com</p>', -1, 4, 0, 25, '2011-05-06 16:04:36', 62, '', '2011-05-26 13:32:00', 62, 0, '0000-00-00 00:00:00', '2011-05-06 16:04:36', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 7, 0, 1, '', '', 0, 7, 'robots=\nauthor='),
(57, 'Condolencia a Nancy Matheus', 'condolencia-a-nancy-matheus', '', '<p style=\"text-align: justify;\"><img src=\"images/stories/luto.gif\" border=\"0\" /> La Gran Familia de la Oficina de Planificación y Presupuesto se une al duelo que aflige a nuestra Jefa y Amiga Nancy Matheus, por el lamentable fallecimiento de su familiar, María Domitila de Velásquez.<br /><br />Rogamos a Dios Todopoderoso por el descanso eterno de su alma y expresamos nuestras más sentidas palabras de condolencia a familiares y amigos.</p>', '', -1, 4, 0, 25, '2011-05-13 14:25:49', 62, '', '2011-05-13 14:38:53', 62, 0, '0000-00-00 00:00:00', '2011-05-13 14:25:49', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 10, 0, 1, '', '', 0, 8, 'robots=\nauthor='),
(55, 'En hora buena nuevo Portal de la Oficina de Planificación y Presupuesto', 'art-opp-nuevo', '', '<p style=\"text-align: justify;\">La Oficina de Planificación y Presupuesto es una Oficina staff dependiente jerárquicamente de la Superintendencia Nacional Aduanera y Tributaria, ésta permite desarrollar un sistema para la formulación de planes y presupuesto debidamente vertebrado, a través del cual, se pueda formular, ejecutar y controlar la asignación presupuestaria de la institución en cada ejercicio presupuestario.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n', '\r\n<p>La Oficina de Planificación y Presupuesto esta conformada por las siguientes divisiones:</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><br />• División de Formulación de Planes y Presupuesto.<br /><br />• División de Seguimiento y Control de planes y Presupuesto.<br /><br />• División de Organización.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">El Portal Web esta creado con la finalidad de facilitar la relación entre las distintas unidades del SENIAT y la dependencia rectora en Planes y Presupuesto.<br /><br />Cumpliendo con las atribuciones que le confiere el Portal Web permite en su práctica y funcionamiento se consideran las técnicas más adecuadas para formular, ejecutar, sugerir y evaluar la política, plan de acción y la producción de bienes y servicios del SENIAT.</p>', -1, 4, 0, 25, '2011-02-10 16:19:39', 62, '', '2011-05-03 12:52:04', 62, 0, '0000-00-00 00:00:00', '2011-02-10 16:19:39', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 0, 0, 2, '', '', 0, 5, 'robots=\nauthor='),
(54, 'Nuevo manual de Normas y Procedimientos de “Manejo y Control de Fondos en Anticipo”', 'art-opp-not3', '', '<p><span style=\"color: #6e6e6e; font-family: Tahoma, Verdana, Arial, \'Courier New\', sans-serif; -webkit-border-horizontal-spacing: 2px; -webkit-border-vertical-spacing: 2px;\"> </span></p>\r\n<p style=\"margin-top: 0px; margin-bottom: 5px; text-align: justify;\">Cumpliendo instrucciones de la Jefa de la <strong>Oficina de Planificación y Presupuesto</strong> conjuntamente con su División de Organización, se informa que el Ciudadano Superintendente Nacional Aduanero y Tributario, aprobó mediante Punto de Cuenta 03 de fecha 13 de enero 2011 el Manual de Normas y Procedimientos Administrativo “<strong>Manejo y Control de Fondos en Anticipo</strong>”.</p>\r\n', '\r\n<p>En este sentido, en el módulo de <strong>Descargas/Organización/Administrativos </strong>(<a href=\"phocadownload/Administrativos/Manejo_Control_Fondos_Anticipo_2010.pdf\" target=\"_blank\">aquí</a>) se encuentra dicho documento, a los fines de su divulgación, distribución a las unidades y/o dependencias y para la ejecución de los procedimientos contenidos en el mismo para el presente ejercicio.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Es importante destacar que en caso de necesitar alguna aclaratoria con respecto al Manual o al Manejo de Fondos en Anticipo podrán comunicarse con las siguientes personas dependiendo de cada una de sus competencias:</p>\r\n<p style=\"text-align: justify;\">•<span style=\"white-space: pre;\"> </span>Oficina de Planificación y Presupuesto:</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">David Pedrique - dpedriq@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Pedro Santos psantos@seniat.gob.ve</p>\r\n<p style=\"text-align: justify;\">• Gerencia General de Administración – SIADM:</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Daniela Barrios Torres - dibarrio@seniat.gob.ve</p>\r\n<p style=\"text-align: justify;\">• División de Organización (Manual):</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Inés Díaz - idiaz@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Diorlins Trompetero - dtrompet@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Alonso Salazar - ajsalaza@seniat.gob.ve</p>\r\n<p style=\"text-align: justify;\">• División de Contabilidad:</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Carlos Ramirez Araque - cramireza@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Miguel Moreno - mjmoreno@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Manuel Aristeguieta - maristig@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">María Toro -mtoro@seniat.gob.ve</p>\r\n<p style=\"text-align: justify;\">•División de Tesorería:</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Neckers Rodríguez - narodriguez@seniat.gob.ve</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Edmeira Ascanio - eascanio@seniat.gob.ve</p>', 1, 4, 0, 37, '2011-02-09 18:39:05', 62, '', '2011-05-03 12:53:12', 62, 0, '0000-00-00 00:00:00', '2011-02-09 18:39:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 5, 0, 3, '', '', 0, 92, 'robots=\nauthor='),
(50, 'Sistemas en Linea', 'art-opp-sis', '', '<p><span style=\"color: #6e6e6e; font-family: Tahoma, Verdana, Arial, \'Courier New\', sans-serif; -webkit-border-horizontal-spacing: 2px; -webkit-border-vertical-spacing: 2px;\"> </span></p>\r\n<p>La Oficina de Planificación y Presupuesto pone a su disposición los enlaces a los dos sistemas con los que cuenta tanto para el proceso de Formulación y de Ejecución de los Planes y Presupuesto.<br /><br />Para acceder a dichos sistemas solo debes ingresar al Portal Interno <strong>SAI – Sistemas Administrativos Internos (<a href=\"http://sai/\" target=\"_blank\">http://sai/</a>)</strong> y seguir los siguientes pasos:<br /><br /></p>\r\n<ul>\r\n<li>Ubicarse en la ficha <strong>BIENVENIDO(A)</strong> e ingresar los campos de <strong>USUARIO </strong>y <strong>CONTRASEÑA </strong>que son los mismos de entrar a la red del SENIAT. <br /> \r\n<ul>\r\n<li>Ejemplo: USUARIO: cdelfin CONTRASEÑA: Seniat2011.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>Una vez validado el usuario, en  la ficha <strong>SERVICIOS </strong>(debajo de  BIENVENIDO(A)) tendrás una opción  con el nombre de <strong>SISTEMAS </strong>la cual te llevara al menú principal de los sistemas asociados a su perfil.</li>\r\n<li>Debes encontrar los Menús SAFORPRE y SIGME.</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><a href=\"http://sai/\" target=\"_blank\" title=\"SAFORPRE\"><img src=\"images/stories/SAFORPRE.gif\" border=\"0\" /></a> <a href=\"http://sai/\" target=\"_blank\" title=\"SIGME\"><img src=\"images/stories/SIGEME.gif\" border=\"0\" /></a></p>\r\n<p style=\"text-align: justify;\">Si no están habilitados dichos sistemas a su perfil puede ponerse en contacto con su analista enlace en la Oficina de Planificación y Presupuesto o con los administradores de los sistemas.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Enlace en la Oficina de Planificación y Presupuesto</p>\r\n<ul>\r\n<li>Ver enlaces por dependencias - <a href=\"phocadownload/enlaces.pdf\" target=\"_blank\">Aqui</a></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Administradores de los Sistemas:</p>\r\n<ul>\r\n<li><span style=\"white-space: pre;\"><span style=\"white-space: pre;\"><span style=\"white-space: pre;\"> </span></span>Carlos Miguel Delfin Andrade</span> - cdelfin@seniat.gob.ve - (0212-274-4612)<span style=\"white-space:pre\"><span style=\"white-space: pre;\"> </span></span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"white-space:pre\">Jose Roberto Garcia Ventura</span> - jgarciav@seniat.gob.ve -  (0212-274-4631)</li>\r\n</ul>', '', 1, 4, 0, 25, '2011-02-08 18:00:05', 62, '', '2011-05-03 12:52:38', 62, 0, '0000-00-00 00:00:00', '2011-02-08 18:00:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 33, 0, 7, '', '', 0, 64, 'robots=\nauthor='),
(51, 'Nuevo manual de Normas y Procedimientos de “Viáticos dentro del País /Al Exterior”', 'art-opp-not2', '', '<p><span style=\"color: #6e6e6e; font-family: Tahoma, Verdana, Arial, \'Courier New\', sans-serif; -webkit-border-horizontal-spacing: 2px; -webkit-border-vertical-spacing: 2px;\"> </span></p>\r\n<p style=\"margin-top: 0px; margin-bottom: 5px; text-align: justify;\">Cumpliendo instrucciones de la Jefa de la <strong>Oficina de Planificación y Presupuesto</strong> conjuntamente con su División de Organización, se informa que el Ciudadano Superintendente Nacional Aduanero y Tributario, aprobó mediante Punto de Cuenta 09 de fecha 31 de enero 2011 el Manual de Normas y Procedimientos Administrativo \"<strong>Viáticos dentro del País / al Exterior</strong>\".</p>\r\n', '\r\n<p>En este sentido, en el módulo de <strong>Descargas/Organización/Administrativos </strong>(<a href=\"phocadownload/Administrativos/Viaticos_dentro_Pais_y_al Exterior.pdf\" target=\"_blank\">aquí</a>) se encuentra dicho documento, a los fines de su divulgación, distribución a las unidades y/o dependencias y para la ejecución de los procedimientos contenidos en el mismo para el presente ejercicio.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Es importante destacar que en caso de necesitar alguna aclaratoria con respecto al Manual o al Manejo de Viáticos podrán comunicarse con las siguientes personas dependiendo de cada una de sus competencias:</p>\r\n<p style=\"text-align: justify;\">•<span style=\"white-space: pre;\"> </span>Oficina de Planificación y Presupuesto:</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">David Pedrique - dpedriq@seniat.gob.ve</p>\r\n<p style=\"text-align: justify;\">• División de Organización (Manual):</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Inés Díaz - idiaz@seniat.gob.ve</p>\r\n<p style=\"text-align: justify;\">• Coordinacón de Viáticos:</p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Julio Mora - jmora@seniat.gob.ve</p>', 1, 4, 0, 37, '2011-02-08 18:39:05', 62, '', '2011-05-03 12:53:01', 62, 0, '0000-00-00 00:00:00', '2011-02-08 18:39:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 14, 0, 2, '', '', 0, 110, 'robots=\nauthor='),
(47, 'Información de la División de Organización', 'art-org-info', '', '<h3 style=\"text-align: center; \">Corresponde a la División de Organización</h3>\r\n<p><span lang=\"ES-TRAD\">1.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Coordinar, supervisar y evaluar las actividades relacionadas con la gestion de la Division e impartir las instrucciones para la ejecución de las funciones correspondientes.</span></p>\r\n<p><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">2.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Analizar y proponer ante las instancias pertinentes, los cambios en materia de estructura organizativa.</span></p>\r\n<p><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">3.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Planificar y ejecutar los estudios ydiagnosticos en materia de de comportamiento  organizacional, orientados al mejoramiento de la eficacioa de la organización</span></p>\r\n<p><span lang=\"ES-TRAD\">4.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Apoyar el diseño de los programas de adiestramiento en cultura organizacional del SENIAT.</span></p>\r\n<p><span lang=\"ES-TRAD\">5.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Establecer y mantener un sistema archivo y control de los documento normativos originales, aprobados por la máxima autoridad a fin de garantizar su clasificación, almacenamiento y resguardo.</span></p>\r\n<p><span lang=\"ES-TRAD\">6.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Asesorar al SENIAT en programes de comunicación Interna y externa.</span></p>\r\n<p><span lang=\"ES-TRAD\">7.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Definir e implementar el sistema de valores y normas de comportamiento de la organización siguiendo los lineamientos del Superintendente Nacional Aduanero Tributario.</span></p>\r\n<p><span lang=\"ES-TRAD\">8.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Asesorar y participar en el desarrollo, actualización y elaboración de los manuales de normas y procedimientos, manuales de organización, formularios, formato, planillas e instructivos de uso del Servicio.</span></p>\r\n<p><span lang=\"ES-TRAD\">9.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Participar en el diseño y especificaciones técnicas, de los formularios, formatos y planillas que contribuyan a garantizar información de los sujetos pasivos en coordinación con as unidades involucradas.</span></p>\r\n<p><span lang=\"ES-TRAD\">10.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\"> Participar en la implantación de los manuales de normas y procedimiento conjuntamente con Las distintas unidades Usuarias.</span></p>\r\n<p><span lang=\"ES-TRAD\">11.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Coordinar con </span><span lang=\"ES-TRAD\">la Gerencia General de Servicios jurídicos su participación para la evaluación legal de las normas y procedimientos que surjan de los manuales.</span></p>\r\n<p><span lang=\"ES-TRAD\">12.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\"> Diseñar, asesorar y participar en el desarrollo de los sistemas administrativos y sus procedimientos, a todos los niveles, que facilite y permita lograr los objetivos del Servicio.</span></p>\r\n<p><span lang=\"ES-TRAD\">13.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\"> Coordinar </span><span lang=\"ES-TRAD\">con </span><span lang=\"ES-TRAD\">la Gerencia General de Tecnologías de Información y Comunicaciones, la automatización de los procedimiento que surjan de los manuales de normas y procedimientos.</span></p>\r\n<p><span lang=\"ES-TRAD\">14.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Elaborar el Plan Operativo Anual de la División, atendiendo a los lineamientos establecidos para tal fin.</span></p>\r\n<p><span lang=\"ES-TRAD\">15.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\"> Asesorar a las dependencias del Servicio en materia de Organización.</span></p>\r\n<p><span lang=\"ES-TRAD\">16.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\"> Firmar </span><span lang=\"ES-TRAD\">los actos y documentos relativos a las funciones de su competencia.</span></p>\r\n<p><span lang=\"ES-TRAD\">17.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\"> establecer </span><span lang=\"ES-TRAD\">las normas a ser aplicadas en el desarrollo de las actividades propias de su competencia mediante la elaboración del Manual de Normas y Procedimiento, bajo el lineamiento establecido para tal fin.</span></p>\r\n<p><span lang=\"ES-TRAD\">18.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\'; \"> </span></span><span lang=\"ES-TRAD\">Las demás que le atribuyan las leyes y normas aplicadas.</span></p>\r\n<p> </p>', '', 1, 4, 0, 37, '2011-02-04 17:11:22', 62, '', '2011-05-25 20:02:00', 62, 0, '0000-00-00 00:00:00', '2011-02-04 17:11:22', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 6, 0, 4, '', '', 0, 325, 'robots=\nauthor='),
(56, '¡Ya es Oficial el Nuevo Portal de Contenido de la Oficina de Planificación y Presupuesto!', 'ya-es-oficial-el-nuevo-portal-de-la-oficina-de-planificacion-y-presupuesto', '', '<p style=\"text-align: justify;\">Mediante el INFOHOY Nº 2205 (<a href=\"phocadownload/INFOHOY_2205.pdf\" target=\"_blank\">Ver Aquí</a>) la Oficina de Planificación y Presupuesto se complació en informar la creación de su portal contenido que en el marco de las políticas de avances tecnológicos impulsadas por el ciudadano Superintendente, José David Cabello Rondón; acatan las normas establecidas en el decreto Nº 3.390 de fecha 23-12-2004, publicado en gaceta oficial Nº 38.095 de fecha 28-12-2004, que ordena el uso prioritariamente de Software Libre desarrollado con Estándares Abiertos, en sus sistemas, proyectos y servicios informáticos.</p>\r\n', '\r\n<p style=\"text-align: justify;\">Este nuevo Portal Web fue creado por la Coordinación de Informática de esta Oficina con la asistencia de la Gerencia General de Tecnología de Información y Comunicaciones, debidamente aprobado por el ciudadano Superintendente Nacional Aduanero y Tributario, y está a la disposición de las dependencias del Servicio para facilitar los procesos correspondientes a las competencias de esta Oficina.  El presente portal maneja:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Menú de descarga de información de interés: directorio telefónico interno, organigrama, manuales de normas y procedimientos, materiales necesarios para los procesos de formulación de planes y presupuesto, rendición de metas, y documentos asociados a la ejecución y control de los planes y presupuesto.</li>\r\n<li>Los accesos directos a los Sistema Informáticos relacionados con las labores de la Oficina.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Cualquier duda u observación en pro del mejoramiento de este portal de contenido por favor comunicarse:<br /><br />Ing. Carlos M. Delfín A.<br />Coordinador de Informática<br />0212-2744612<br />0416-9301470<br />cdelfin@seniat.gob.ve<br />delfincarlos82@hotmail.com<br /><br />Jose R. García V.<br /> 0212-2744074<br />jgarciav@seniat.gob.ve<br /> josegarciav@hotmail.com</p>', -1, 4, 0, 25, '2011-05-06 16:04:36', 62, '', '2011-05-25 16:31:21', 62, 0, '0000-00-00 00:00:00', '2011-05-06 16:04:36', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 13, 0, 2, '', '', 0, 23, 'robots=\nauthor='),
(48, 'Información de la Oficina', 'art-opp-info', '', '<h3 style=\"text-align: center;\"><strong>La Oficina de Planificación y Presupuesto tendrá las siguientes atribuciones</strong></h3>\r\n<h3 style=\"text-align: justify;\"><span style=\"color: #333333; font-family: Tahoma, Helvetica, Arial, sans-serif; font-weight: normal; font-size: 12px;\">1. Dirigir, planificar, coordinar, supervisar, controlar y evaluar las actividades relacionadas con la gestión técnica y administrativa de la Oficina, e impartir las instrucciones para la ejecución de las funciones correspondientes.</span></h3>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">2. Apoyar al Superintendente del Servicio Nacional de Administración Aduanera y Tributaria y a las áreas del SENIAT en los procesos de planificación y presupuesto.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">3. Planificar, organizar, dirigir, controlar y evaluar los proyectos especiales que le sean asignados por el Superintendente del Servicio Nacional de Administración Aduanera y Tributaria.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">4 Participar en la definición de las orientaciones, prioridades, normas y procedimientos empleados en la determinación de la política presupuestaria previa del SENIAT. en el marco de las políticas globales sectoriales y regionales del Sector Público.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">5. Coordinar el proceso de discusión, tanto interno como externo relacionado con el proceso de formulación presupuestaria del SENLAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">6 Revisar, analizar y consolidar la información remetida por las distintas Unidades ejecutoras que conforman la Estructura programática del SENIAT, para elaborar anualmente el Anteproyecto de Presupuesto de Recursos y Gastos del Servicio.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">7. Formular y recomendar la aplicación de políticas para la institucionalización de los procesos de planificación, seguimiento y evaluación de la ejecución de planes.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">8. Formular la versión definitiva del Plan operativo Institucional y del Proyecto de Presupuesto de financiamiento y gastos del SENIA.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">9. Participar en la definición de las políticas, objetivos y metas a incluir en el Plan Operativo Anual del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">10 Evaluar los lineamientos estratégicos, política y planes emanados de la comisión central de planificación.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">11. Coordinar el proceso de programación y reprogramación de la Ejecución del presupuesto. En este contexto, participar conjuntamente con la Unidad de Tesorería en la aprobación de las cuotas de compromiso, gastos causados y pagos a regir en cada ejercicio presupuestario.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">12 Participar en la definición de las orientaciones, prioridades, normas y procedimientos empleados en la determinación de la política presupuestaria previa del SENIAT, en el marco de Las políticas globales, y regionales del Sector Público.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">13 Elaborar el cronograma de trabajo <em>para </em>el plan operativo anual y la formulación de proyecto de presupuesto en cada ejercicio económico.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">14 Preparar las normas, formularios e instructivos requeridos en las diferentes fases del proceso presupuestario.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">15. Analizar, tramar y cuando corresponda, aprobar las solicitudes de modificaciones de los planes operativos anuales y presupuestarios, según le normativa legal vigente.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">16. Formular la versión definitiva del Proyecto de presupuesto de Financiamiento y Gastos del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">17. Analizar y tramar el proceso de Reformulación del Plan y del Presupuesto, en correspondencia con el ordenamiento legal vigente.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">18. Ejercer Labores relacionadas con el control y la evaluación de la ejecución del presupuesto y emitir los correspondientes informes técnicos con la periodicidad que al electo se establezca, para los diferentes usuarios internos y externos del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">19. Presentar ant. el Superintendente Nacional Aduanero y Tributario los cambio, en la estructura programática que surjan como producto de Las modificaciones de políticas y conforme a las disposiciones legales pertinentes.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">20. Asesorar en materia presupuestaria a las distintas unidades ejecutoras que conforman la Estructura Programática del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">21. Presentar informes mensuales de la situación de las partidas presupuestarias, al Superintendente Nacional Aduanero y Tributario.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">22. Conocer la  Contabilidad Presupuestaria del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">23. Analizar la ejecución financiera y elaborar la estimación de los excedentes de cela y banco al cierre de cada silo, e informar periódicamente de la ejecución presupuestaria a las diferentes Gerencias del Servicio.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">24. Atender la demanda de información presupuestaria requerida por los órganos centrales de asignación de recursos.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">25. Proponer un sistema de administración que facilite y permita lograr los objetivos de la institución.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">26. Coordinar con el Comité Asesor de Dirección y Planificación, la formulación del plan estratégico de la entidad y rendir informes periódicos de seguimiento y evaluación y recomendar los ajustes a que haya lugar.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">27. Preparar, editar y divulgar estudios sobre el entorno socio-económico y político relacionado con el proceso de planificación del SENIAT y formular recomendaciones.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">28. Asesorar al Superintendente del Servicio Nacional de Administración Aduanera y Tributaria y a Las demás áreas funcionales y dependencias del SEN IAT con respecto a lo niveles de productividad institucional.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">29. Establecer normas técnicas, para la elaboración de los planes y el presupuesto para que sean aplicadas por las áreas funcionales del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">30. Apoyar y coordinar en la elaboración de los planes operativos y formulación del presupuesto en cada una de las áreas del SENIAT, y en su correspondiente integración.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">31. Diseñar y coordinar la implantación del sistema de información para la elaboración, seguimiento y evaluación del plan estratégico, planes operativos y del presupuesto.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">32. Realizar el seguimiento y evaluar la ejecución del plan estratégico institucional y de los planes operativos de las áreas del SENIAT pera identificar desviaciones y formular recomendaciones.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">33. Elaborar, supervisar y controlar el plan operativo de su área de acuerdo a los lineamientos y procedimientos establecidos.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">34. Suministrar a la Gerencia General de Administración, información sobre la evaluación de los planes operativos de las áreas y sus indicadores de productividad, que contribuyan a alimentar el sistema de evaluación del desempeño del personal por resultado.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">35. Preparar informes periódicos pera conocimientos del Superintendente del Servido Nacional de Administración Aduanera y Tributaria respecto al cumplimiento de objetivos y metas de la entidad.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">36. Elaborar la Memoria y Cuenta del Servicio Nacional Integrado de Administración Aduanera y Tributaria SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">37. Dirigir, coordinar, supervisar y evaluar los proyectos nacionales, internacionales o especiales asignado por el Superintendente del Servicio Nacional de Administración Aduanera y Tributaria.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">38. Planificar y desarrollar lo estudios de La organización estructural, funcional y de análisis de comportamiento organizacional.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">39, Diseñar y administrar la base de dato, que contenga los manuales de organización, sistemas administrativos y manuales de funciones y procedimientos.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">40. Planificar y controlar el desarrollo de la cultura organizacional del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">41. Planificar, proponer y controlar los cambios organizacionales del SENIAT.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">42. Asesorar en materia de organización y sistemas gerenciales a toda la Institución.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">43. Supervisar y evaluar el proceso de elaboración de manuales de organización y de normas y procedimientos, así como impartir las medidas correctivas necesarias.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">44. Asistir al nivel operativo en el cumplimiento de sus funciones, normas y demás disposiciones referentes a las materias de competencia de esta Oficina.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">45. Establecer las necesidades específicas de capacitación de los funcionarios, bajo su mando en coordinación de la Oficina Centro de Estudios Fiscales.</p>\r\n<p style=\"margin-bottom: 12pt; text-align: justify;\">46. Revisar y Presentar el Anteproyecto de Presupuesto Anual para gastos de funcionamiento de la oficina, de acuerdo a los lineamientos y procedimientos establecidos para tal fin.</p>\r\n<p style=\"text-align: justify;\">47. establecer las normas a ser aplicadas en el desarrollo de las actividades propias de su competencia, mediante la elaboración de los Manuales de Organización y las Normas y Procedimientos de la Oficina, bajo los lineamientos y procedimientos establecidos para tal fin.</p>\r\n<p style=\"text-align: justify;\">48. Firmar los actos y documentos relativos a las funciones de su competencia.</p>\r\n<p style=\"text-align: justify;\">49. Las demás que le atribuyan las leyes y normas aplicables.</p>', '', 1, 4, 0, 25, '2011-02-04 17:11:22', 62, '', '2011-05-03 12:52:50', 62, 0, '0000-00-00 00:00:00', '2011-02-04 17:11:22', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 7, 0, 8, '', '', 0, 575, 'robots=\nauthor='),
(44, 'Organigrama', 'art-opp-orga', '', '<h3 style=\"text-align: center;\">Organigrama</h3>\r\n<p style=\"text-align: center;\"><img src=\"images/stories/Organigrama_OPP.jpg\" border=\"0\" /></p>', '', 1, 4, 0, 25, '2011-02-04 17:11:22', 62, '', '2011-05-03 12:53:47', 62, 62, '2011-07-28 18:02:03', '2011-02-04 17:11:22', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 11, 0, 9, '', '', 0, 167, 'robots=\nauthor='),
(45, 'Información de la División de Formulación', 'art-opp-info', '', '<h3 style=\"text-align: center;\">Corresponde a la División de Formulación de Planes de Presupuesto</h3>\r\n<h3 style=\"text-align: justify;\"><span style=\"color: #333333; font-family: Tahoma, Helvetica, Arial, sans-serif; font-weight: normal; font-size: 12px;\"><span lang=\"ES-TRAD\">1.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Coordinar con los entes de Planificación </span><span lang=\"ES-TRAD\">del Estado lo relativo a los </span>lineamientos de los Planes de Desarrollo Económico y Social de la nación y la metodología para la elaboración del Plan Operativo Anual del SENIAT.</span></h3>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">2.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Coordinar el proceso de discusión tanto interna corno externa relacionado con la formulación presupuestaria del SENIAT</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">3.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Gestionar el diseño participativo del Plan Operativo anual SENIAT       y el Plan Estratégico del SENIAT asegurando el consenso institucional y su internalización en todos los niveles de la organización mediante la efectiva divulgación y publicación.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">4.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Participar en la definición de La política presupuestaria previa del SENIAT, en el marco de las políticas globales, sectoriales y regionales del sector público.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">5.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Proponer los lechos financieros a utilizar en el proceso de formulación de presupuesto anual, en coordinación con la división de seguimiento y control de planes y Presupuestos.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">6.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Elaborar el cronograma de trabajo para la formulación del plan operativo anual y del proyecto de presupuesto de cada ejercicio económico.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\"> </span><span lang=\"ES-TRAD\">7.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Coordinar las asesoráis, la asistencia técnica y la capacitación de funcionarios enlaces de las dependencias normativas y operativas del SENIAT en la elaboración de sus planes operativos anuales y presupuesto, mediante información y criterios unánimes para los procesos de diseño y presentación de los mismos.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">8.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Apoyar </span><span lang=\"ES-TRAD\">a las diferentes áreas del SENIAT en le formulación de los </span>planes y el presupuesto, así como coordinar su correspondiente integración.</p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">9.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Elaborar, ajustar y proponer los cambios en la estructura programática que surjan corno producto de las modificaciones de políticas y </span><span>conforme </span> <span>a las disposiciones legales pertinentes.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">10.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Revisar, analizar y consolidar la información relativa a la formulación presupuestaria presentada por las unidades ejecutoras que conforman  la estructura programática del SENIAT a fin de elabora el anteproyecto.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">11.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Promover y difundir las políticas y normas técnicas de planificación y </span><span>presupuesto, para </span>que sean aplicadas de manera uniforme por todas las áreas del SENIAT.</p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">12.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Formular la versión definitiva del plan operativo institucional Y del proyecto de presupuesto a los efectos de su aprobación ante las instancias respectivas.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">13.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Coordinar el proceso </span><span lang=\"ES-TRAD\">de programación y reprogramación del presupuesto a los efectos de participar conjuntamente con la unidad de tesorería en la aprobación de las cuotas de compromiso, y pagos a regir en cada ejercicio económico.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">14.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Proponer recomendaciones para actualizar las políticas y normas técnicas de planificación y presupuesto.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">15.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Promover y coordinar La capacitación de los funcionarios del SENIAT para la aplicación de las normas técnicas de los procesos de Planificación y Presupuesto.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">16.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Gestionar para que las diferentes áreas del SENIAT reporten periódica y oportunamente sus planes operativos en las fechas establecidas por las autoridades.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">17.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Revisar La estructuración de lo. punes pera </span><span lang=\"ES-TRAD\">realizar recomendaciones.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">18.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Realizar investigaciones y </span><span lang=\"ES-TRAD\">recabar información sobre las tendencias del </span><span>entorno socio económico y político relacionado con </span>el <span>proceso </span>de planificación del SENIAT, para formular recomendaciones.</p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">19.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Asistir al nivel operativo en el </span><span lang=\"ES-TRAD\">cumplimiento de sus funciones, normas y demás disposiciones referentes a las materias de competencia de esta división.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">20.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Coordinar con las áreas correspondientes en la edición y divulgación del </span>plan estratégico institucional y los planes operativos.</p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">21.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Establecer un sistema de información para unificar, administrar y </span><span lang=\"ES-TRAD\"><span>controlar el proceso de elaboración de planes y </span></span><span lang=\"ES-TRAD\">presupuesto.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">22.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Elaborar el Plan Operativo Anual de la División, de acuerdo con los </span>lineamientos establecidos para tal fin.</p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">23.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Firmar los actos y los documentos relativos a las funciones de sus competencias.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">24.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Establecer las normas a ser aplicadas en el desarrollo de las actividades propias de sus competencias mediante la elaboración de un manual de Normas y Procedimientos, bajo los lineamientos para tal fin.</span></p>\r\n<p style=\"text-align: justify;\"><span lang=\"ES-TRAD\">25.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Las demás que le atribuyan las leyes y normas aplicadas.</span></p>', '', 1, 4, 0, 35, '2011-02-04 17:11:22', 62, '', '2011-05-27 15:38:35', 66, 0, '0000-00-00 00:00:00', '2011-02-04 17:11:22', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 13, 0, 1, '', '', 0, 459, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(46, 'Información de la División de Ejecución', 'art-eje-info', '', '<h3 style=\"text-align: center;\">Corresponde a la División de Seguimiento y Control de Planes y Presupuesto</h3>\r\n<p><span lang=\"ES-TRAD\">1.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Realizar el seguimiento </span><span lang=\"ES-TRAD\">y </span><span lang=\"ES-TRAD\">evaluación de la ejecución de plan estratégico y de los planes operativos de las diferentes áreas del SENIAT y formular recomendaciones.</span></p>\r\n<p><span lang=\"ES-TRAD\">2.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Asesorar a las áreas del SENIAT en la identificación de desviaciones en la ejecución de planes, para que se realicen los correctivos necesarios.</span></p>\r\n<p><span lang=\"ES-TRAD\">3.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Informar sobre los lineamientos estratégicos, políticas y planes emanados de la comisión central de planificación.</span></p>\r\n<p><span lang=\"ES-TRAD\">4.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Establecer un sistema de información que permita realizar el seguimiento y evaluación del cumplimiento del plan estratégico institucional y los planes operativos.</span></p>\r\n<p><span lang=\"ES-TRAD\">5.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Generar reportes para conocimientos de las autoridades del SENIAT sobre el cumplimiento del plan estratégico institucional y los planes operativos.</span></p>\r\n<p><span lang=\"ES-TRAD\">6.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Incorporar información estadística en los sistemas de control de gestión del Ministerio del Poder popular para la Planificación y el desarrollo.</span></p>\r\n<p><span lang=\"ES-TRAD\">7.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Realizar estudios sobre productividad institucional y de las áreas del SENIAT.</span></p>\r\n<p><span lang=\"ES-TRAD\">8.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Administrar el sistema de información estadístico del cumplimiento de objetivos y metas por parte de todas las dependencias del SENIAT.</span></p>\r\n<p><span lang=\"ES-TRAD\">9.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Suministrar información periódicamente a las intendencias y a la Gerencia General de Administración, sobre los objetivos y metas logrados por cada area funcional.</span></p>\r\n<p><span lang=\"ES-TRAD\">10.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Elaborar el proyecto de la Memoria y cuenta del SENIAT. Conjuntamente con el organismo de adscripción para presentarlo a la consideración del superintendente nacional aduanero y tributario.</span></p>\r\n<p><span lang=\"ES-TRAD\">11.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Analizar y tramitar el proceso de reformulación de la planificación y del presupuesto en correspondencia con el ordenamiento legal vigente.</span></p>\r\n<p><span lang=\"ES-TRAD\">12.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Analizar y tramitar las solicitudes de modificaciones presupuestarias, de acuerdo a la normativa legal vigente.</span></p>\r\n<p><span lang=\"ES-TRAD\">13.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Ejercer conjuntamente con la división de formulación de planes y presupuesto, las labores relacionadas con el control y evaluación de la ejecución del presupuesto y emitir los correspondientes informes técnicos con la periodicidad que al efecto se establezca.</span></p>\r\n<p><span lang=\"ES-TRAD\">14.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Asesora con la división de formulación de planes y presupuesto a las diferentes unidades ejecutoras que conforman la estructura programática del SENIAT.</span></p>\r\n<p><span lang=\"ES-TRAD\">15.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Presentar a través del jefe de la oficina, informes mensuales de la situación de las partidas presupuestarias al Superintendente Nacional Aduanero y Tributario.</span></p>\r\n<p><span lang=\"ES-TRAD\">16.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Conocer la contabilidad Presupuestaria del SENIAT y emitir los reportes requeridos por los diferentes usuarios internos y externos al servicio.</span></p>\r\n<p><span lang=\"ES-TRAD\">17.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">elaborar la estimación de los excedentes de caja y banco al cierre de cada año, e informar periódicamente de la ejecución presupuestaria a las diferentes Gerencias del Servicio.</span></p>\r\n<p><span lang=\"ES-TRAD\">18.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">evaluar la ejecución física del plan y del presupuesto sobre la base de los indicadores de gestión previstos y de acuerdo con las normas técnicas correspondientes.</span></p>\r\n<p><span lang=\"ES-TRAD\">19.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Elaborar y proponer indicadores de gestión a objeto de evaluar el desempeño del servicio.</span></p>\r\n<p><span lang=\"ES-TRAD\">20.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Elaborar informes sobre las desviaciones en el presupuesto de recursos y gastos.</span></p>\r\n<p><span lang=\"ES-TRAD\">21.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Llevar y registrar las estadísticas de las funciones presupuestarias del Servicio.</span></p>\r\n<p><span lang=\"ES-TRAD\">22.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Asistir al nivel operativo en el cumplimiento de sus funciones, normas y demás disposiciones referentes a las materias de competencia de esta división.</span></p>\r\n<p><span lang=\"ES-TRAD\">23.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">elaborar un plan Operativo Anual de División, atendiendo a los lineamientos establecidos para tal fin.</span></p>\r\n<p><span lang=\"ES-TRAD\">24.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Firmar los actos y documentos relativos a las funciones de sus competencias.</span></p>\r\n<p><span lang=\"ES-TRAD\">25.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\"> establecer las normas a ser aplicadas en el desarrollo de actividades propias a sus competencias mediante la elaboración del manual normas y procedimientos, bajo los lineamientos establecidos para tal fin.</span></p>\r\n<p><span lang=\"ES-TRAD\">26.<span style=\"font: normal normal normal 7pt/normal \'Times New Roman\';\"> </span></span><span lang=\"ES-TRAD\">Las demás que le atribuyan las leyes y normas aplicadas.</span></p>\r\n<p> </p>', '', 1, 4, 0, 36, '2011-02-04 17:11:22', 62, '', '2011-05-03 12:52:17', 62, 62, '2011-07-06 18:08:29', '2011-02-04 17:11:22', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 6, 0, 1, '', '', 0, 254, 'robots=\nauthor='),
(61, '¡Inicio del Proceso de Formulación 2012 con las Gerencias Regionales y Sectores de Tributos Internos!', 'iinicio-del-proceso-de-formulacion-2012-con-las-gerencias-regionales-y-sectores-de-tributos-internos', '', '<p style=\"text-align: justify;\"><strong>Lineamientos Generales para la Formulación del Plan Operativo Anual y el Anteproyecto de Presupuesto 2012</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/stories/jornadas/07-07-2011/art.jpg\" border=\"0\" /></p>\r\n<p style=\"text-align: justify;\">La Oficina de Planificación y Presupuesto en cumplimiento de una de las atribuciones dió inicio a la primera jornada sobre los lineamientos generales para la elaboración de la Formulación del Plan Operativo Anual Institucional y el Anteproyecto de Presupuesto para el ejercicio fiscal 2012.</p>\r\n', '\r\n<p><strong>Se contó con la participación de funcionarios moderadores adscritos a las dependencias:</strong></p>\r\n<ul>\r\n<li>OFICINA DE PLANIFICACION Y PRESUPUESTO</li>\r\n<li>INTENDENCIA NACIONAL DE TRIBUTOS INTERNOS</li>\r\n<li>GERENCIA DE FISCALIZACIÓN</li>\r\n<li>GERENCIA DE RECAUDACIÓN</li>\r\n<li>GERENCIA GENERAL DE TECNOLOGÍA Y COMUNICACIONES</li>\r\n<li>OFICINA DE RELACIONES INSTITUCIONALES</li>\r\n<li>OFICINA CENTRO DE  ESTUDIOS FISCALES</li>\r\n<li>GERENCIA DE INFRAESTRUCTURA</li>\r\n<li>DIVISIÓN DE SERVICIO</li>\r\n<li>DIVISIÓN DE COMPRAS Y CONTRATOS</li>\r\n</ul>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>Las unidades participantes en la jornada fueron:</strong></p>\r\n<ul>\r\n<li>G.R.T.I. REGION CAPITAL</li>\r\n<li>S.T.I. VALLES DEL TUY</li>\r\n<li>S.T.I. LA GUAIRA</li>\r\n<li>S.T.I. GUARENAS GUATIRE</li>\r\n<li>S.T.I. LOS ALTOS MIRANDINOS</li>\r\n<li>S.T.I. BARUTA</li>\r\n<li>S.T.I. LIBERTADOR</li>\r\n<li>S.T.I HIGUEROTE</li>\r\n<li>G.R.T.I. CONT. ESP. REG. CAPITAL</li>\r\n<li>G.R.T.I. REGION CENTRAL</li>\r\n<li>S.T.I. MARACAY</li>\r\n<li>G.R.T.I. REGION CENTRO OCCIDENTAL</li>\r\n<li>G.R.T.I. REGION ZULIANA</li>\r\n<li>S.T.I. SANTA BARBARA DEL ZULIA</li>\r\n<li>S.T.I. CIUDAD OJEDA</li>\r\n<li>G.R.T.I. REGION LOS ANDES</li>\r\n<li>S.T.I. MERIDA</li>\r\n<li>S.T.I. BARINAS</li>\r\n<li>S.T.I. TRUJILLO</li>\r\n<li>S.T.I. LA FRÍA</li>\r\n<li>S.T.I EL VIGIA</li>\r\n<li>G.R.T.I. REGION NOR-ORIENTAL</li>\r\n<li>S.T.I. MATURÍN</li>\r\n<li>S.T.I. ANACO</li>\r\n<li>S.T.I CARUPANO</li>\r\n<li>S.T.I EL TIGRE</li>\r\n<li>G.R.T.I. REGION GUAYANA</li>\r\n<li>S.T.I. PUERTO ORDAZ</li>\r\n<li>G.R.T.I. REGION INSULAR</li>\r\n<li>G.R.T.I. REGION LOS LLANOS</li>\r\n</ul>', 1, 4, 0, 25, '2011-07-07 08:21:37', 62, '', '2011-07-07 15:07:05', 62, 0, '0000-00-00 00:00:00', '2011-07-07 08:21:37', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 9, 0, 6, '', '', 0, 78, 'robots=\nauthor='),
(62, '¡Segunda Reunión de Formulación 2012 con las Gerencias de Aduanas Principales y Subalternas!', 'isegunda-reunion-de-formulacion-2012-con-las-gerencias-de-aduanas-principales-y-subalternas', '', '<p style=\"text-align: justify;\"><strong>Lineamientos Generales para la Formulación del Plan Operativo Anual y el Anteproyecto de Presupuesto 2012</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/stories/jornadas/08-07-2011/art.jpg\" border=\"0\" /></p>\r\n<p style=\"text-align: justify;\">La Oficina de Planificación y Presupuesto en cumplimiento de una de las atribuciones efectuó la segunda jornada sobre los lineamientos generales para la elaboración de la Formulación del Plan Operativo Anual Institucional y el Anteproyecto de Presupuesto para el ejercicio fiscal 2012.</p>\r\n', '\r\n<p><strong>Se contó con la participación de funcionarios moderadores adscritos a las dependencias:</strong></p>\r\n<ul>\r\n<li>OFICINA DE PLANIFICACION Y PRESUPUESTO</li>\r\n<li>INTENDENCIA NACIONAL DE ADUANAS</li>\r\n<li>OFICINA DE GESTIÓN INTERNA</li>\r\n<li>OFICINA DE ESTADÍSTICAS Y ESTUDIOS ECONÓMICOS</li>\r\n</ul>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>Las unidades participantes en la jornada fueron:</strong></p>\r\n<ul>\r\n<li>G.R.T.I. REGION CAPITAL</li>\r\n<li>ADUANA PRINCIPAL MARÍTIMA DE LA GUAIRA</li>\r\n<li>ADUANA PRINCIPAL AÉREA DE MAIQUETÍA</li>\r\n<li>ADUANA SUB. DEL AEROPUERTO INTERNACIONAL</li>\r\n<li>ADUANA PRINCIPAL DE PUERTO CABELLO</li>\r\n<li>ADUANA PRINCIPAL LAS PIEDRAS PARAGUANA</li>\r\n<li>ADUANA PRINCIPAL CENTRO OCCIDENTAL</li>\r\n<li>ADUANA PRINCIPAL DE MARACAIBO</li>\r\n<li>ADUANA SUB. PARAGUACHON</li>\r\n<li>ADUANA PRINCIPAL  GUANTA PTO LA CRUZ</li>\r\n<li>ADUANA SUB. AÉREA MATURÍN</li>\r\n<li>ADUANA PRINCIPAL DE PUERTO SUCRE</li>\r\n<li>ADUANA PRINCIPAL DE CIUDAD GUAYANA</li>\r\n<li>ADUANA PRINCIPAL DEL GUAMACHE</li>\r\n<li>ADUANA PRINCIPAL DE SAN ANTONIO DEL TÁCHIRA</li>\r\n<li>ADUANA PRINCIPAL ECOLÓGICA DE PUERTO AYACUCHO</li>\r\n<li>ADUANA PRINCIPAL DE GUIRIA</li>\r\n<li>ADUANA PRINCIPAL AÉREA DE VALENCIA</li>\r\n<li>ADUANA PRINCIPAL DE MÉRIDA</li>\r\n<li>ADUANA PRINCIPAL ECOLÓGICA DE SANTA ELENA DE UAIREN</li>\r\n</ul>', 1, 4, 0, 25, '2011-07-07 08:21:37', 62, '', '2011-07-11 13:51:01', 62, 0, '0000-00-00 00:00:00', '2011-07-07 08:21:37', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 3, 0, 5, '', '', 0, 76, 'robots=\nauthor='),
(63, 'Contactos para acceder al Sistema SAFORPRE 2012', 'contactos-para-acceder-al-sistema-saforpre-2012', '', '<p><strong>Carlos Miguel Delfin Andrade</strong><br />Correo: <strong>cdelfin@seniat.gob.ve</strong><br />Teléfono:<strong> 0212-2744612 / 0416-9301470</strong><br /> <br /> <br /><strong>José Roberto García Ventura</strong><br />Correo: <strong>jgarciav@seniat.gob.ve</strong><br />Teléfono:<strong> 0212-2744074</strong></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">Recuerde que estos números son única y exclusivamente para atender requerimientos relacionados con el sistema. Si tiene alguna duda sobre la Formulación del Presupuesto realícela por el teléfono 0212-2744231.</p>', '', -1, 4, 0, 25, '2011-07-11 16:46:26', 62, '', '2011-07-11 18:05:26', 62, 0, '0000-00-00 00:00:00', '2011-07-11 16:46:26', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 2, 0, 2, '', '', 0, 16, 'robots=\nauthor='),
(64, 'INFOSENIAT Nº 1048 con el cual se Fortalece el Sistema Aduanero y Tributario Socialista', 'infoseniat-no-1048-con-el-cual-se-fortalece-el-sistema-aduanero-y-tributario-socialista', '', '<p style=\"text-align: justify;\">En los talleres convocados por la Oficina de Planificación y Presupuesto, funcionarios de la Intendencia Nacional de Aduanas, Intendencia Nacional de Tributos Internos, conjuntamente con las Gerencias de Recaudación y Fiscalización, dictaron los lineamientos de esta etapa a los encargados del área de planificación de las distintas Gerencias Regionales y Aduanas Principales y Subalternas del país.</p>\r\n<p style=\"text-align: center;\"><a href=\"phocadownload/INFOSENIAT_1048.pdf\" target=\"_blank\"><img src=\"images/stories/opp/info_1048.png\" border=\"0\" /></a></p>\r\n<p style=\"text-align: center;\">Descargas/Generales/Información General/<a href=\"phocadownload/INFOSENIAT_1048.pdf\" target=\"_blank\">INFOSENIAT 1048</a></p>', '', 1, 4, 0, 25, '2011-07-13 20:35:27', 62, '', '2011-07-13 20:55:26', 62, 0, '0000-00-00 00:00:00', '2011-07-13 20:35:27', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 5, 0, 4, '', '', 0, 16, 'robots=\nauthor='),
(65, 'Celebración del Día del Padre, Cumpleañeros y Despedida a Nuestros Compañeros Jubilados', 'celebracion-del-dia-del-padre-cumpleaneros-y-despedida-a-nuestros-companeros-jubilados', '', '<p style=\"text-align: justify;\">La Gran Familia de la Oficina de Planificación y Presupuesto celebró con alegría aunque un poco retrasado el día de los padres, la figura que dentro de hogar forja el carácter de los hijos y quien con amor y firmeza los guía en el sendero de la vida.</p>\r\n<p style=\"text-align: center;\"><img src=\"images/stories/opp/Familia.png\" border=\"0\" /></p>\r\n<p style=\"text-align: center;\">Visita nuestra Galería Imagenes/<a href=\"index.php?option=com_phocagallery&amp;view=category&amp;id=15:celebracion-del-05-ago-2011&amp;Itemid=68\">Celebración del 05 Ago 2011</a></p>\r\n', '\r\n<p>Alguna de las Palabras de la Jefa de la Oficina la Eco. Nancy Matheus de Velásquez:</p>\r\n<p><strong>\"</strong>A todos ustedes un abrazo y mis deseos porque todos los días vean compensado el esfuerzo que hacen por sus hijos y familia.</p>\r\n<p>Honramos especialmente en este día a nuestros compañeros de faena diaria quienes obtuvieron el beneficio de la jubilación como compensación a los años de trabajo que prestaron a esta Institución. No quería que salieran de ésta su casa sin un merecido reconocimiento de parte de todos sus compañeros con quienes compartieron diariamente sus tareas.</p>\r\n<p> </p>\r\n<p>A ustedes mi más sincera felicitación y deseos por el éxito en esta nueva etapa de sus vidas con mas serenidad y calidad.<br />También, celebramos hoy con nuestros compañeros que cumplieron año durante los meses de mayo, junio y julio, que por las carreras del quehacer diario habíamos suspendido pero no olvidado su celebración. <br />Para ustedes Feliz cumpleaños!</p>\r\n<p> </p>\r\n<p>A todos ustedes y al resto del personal quiero darles como regalo estas herramientas:</p>\r\n<ul>\r\n<li>Se impecable con tus palabras: La palabra es el instrumento más poderoso que tienes como ser humano; constituye el poder para crear. Lo que sueñas, lo que sientes y lo que realmente eres lo muestras por medio de las palabras. La impecabilidad de la palabra engendrara belleza, amor y cielo en la tierra. Según como las uses te liberaran o esclavizaran.</li>\r\n<li>No te tomes nada personalmente: Suceda lo que suceda a tu alrededor no te tomes nada personalmente, sea lo que sea lo que la gente haga, piense o diga, no te lo tomes personalmente. Tu sabes que eres maravilloso no es necesario que otras personas te lo digan. Cuando esto se convierta en un hábito fuerte y sólido sentirás felicidad libertad y paz interior.</li>\r\n<li>No hagas suposiciones: Suponer que el resto de la gente ve la vida como nosotros o que debe saber lo que queremos o lo que necesitamos nos trae dificultades y malentendidos, se claro en la comunicación, impecable en tus palabras.</li>\r\n<li>Haz siempre lo máximo que puedas: Bajo cualquier circunstancia de la vida, independientemente del resultado haz siempre lo máximo que puedas. Si siempre haces lo máximo que puedas, no te juzgaras, no te harás reproches, ni te culparas ni te castigaras.<strong>\"</strong></li>\r\n</ul>', 1, 4, 0, 25, '2011-08-10 16:41:17', 62, '', '2011-08-10 17:11:47', 62, 0, '0000-00-00 00:00:00', '2011-08-10 16:41:17', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 3, 0, 3, '', '', 0, 37, 'robots=\nauthor='),
(66, 'Curso sobre Indicadores de Gestión', 'curso-sobre-indicadores-de-gestion', '', '<p style=\"text-align: justify;\">Los funcionarias de la Oficina de Planificación y Presupuesto como de algunas unidades del nivel Normativo de la Institución, se complacieron en asistir en el curso sobre Indicadores de Gestión donde conocieron los elementos básicos, tanto legales como metodológicos, de la formulación de indicadores de gestión siendo esta una de las herramientas del control interno.<br /><br />Dicho curso fue dictado por la Urb. Josmari Carrillo y consto del siguiente  contenido:</p>\r\n<ul>\r\n<li>Aspectos Legales.</li>\r\n<li>Marco Conceptual.</li>\r\n<li>Aspectos Metodologicos.</li>\r\n<li>Gerencia por Procesos.</li>\r\n<li>Ejercicios Practicos.</li>\r\n</ul>\r\n<div>\r\n<div style=\"text-align: center;\"><em>\"Si no se mide lo que se hace, no se </em><em>puede controlar y</em></div>\r\n<div style=\"text-align: center;\"><em></em><em>si no se puede </em><em>controlar, no se puede dirigir y</em></div>\r\n<div style=\"text-align: center;\"><em>si no se </em><em>puede dirigir no se puede mejorar\"</em></div>\r\n</div>\r\n<p style=\"text-align: center;\"><br />Presentación Descargas/Generales/Información General/<a href=\"phocadownload/Indicadores_Gestion.pdf\" target=\"_blank\">Indicadores de Gestión</a></p>', '', 1, 4, 0, 25, '2011-10-20 17:26:26', 62, '', '2011-10-24 17:22:20', 62, 0, '0000-00-00 00:00:00', '2011-10-20 17:26:26', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 7, 0, 2, '', '', 0, 72, 'robots=\nauthor='),
(67, 'Normativa', 'normativa', '', '<ul>\r\n<li><a href=\"http://tibisay.seniat.gob.ve/somosseniat/botones/LEY_SENIAT.pdf\" target=\"_blank\">Ley del SENIAT</a></li>\r\n<li><a href=\"http://tibisay.seniat.gob.ve/somosseniat/botones/RESOLUCION_32.pdf\" target=\"_blank\">Resolución 32</a> </li>\r\n<li><a href=\"http://www.seniat.gob.ve/portal/page/portal/MANEJADOR_CONTENIDO_SENIAT/06SOMOS_SENIAT/6.3NORMATIVA/6.3.3DECRETOS\" target=\"_blank\">Decretos</a></li>\r\n<li><a href=\"http://www.seniat.gob.ve/portal/page/portal/MANEJADOR_CONTENIDO_SENIAT/06SOMOS_SENIAT/6.3NORMATIVA/6.3.4PROVIDENCIAS\" target=\"_blank\">Providencias</a></li>\r\n<li><a href=\"http://tibisay.seniat.gob.ve/somosseniat/botones/MANUAL_ETICA.pdf\" target=\"_blank\">Manual de Ética </a></li>\r\n</ul>', '', 1, 5, 0, 46, '2011-10-27 16:59:45', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-10-27 16:59:45', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 4, '', '', 0, 75, 'robots=\nauthor='),
(68, 'Principios y Valores', 'principios-y-valores', '', '<p style=\"text-align: center;\"><img src=\"images/stories/principios.png\" border=\"0\" /></p>\r\n<p> </p>\r\n<p><strong>Principios</strong></p>\r\n<ul>\r\n<li>Transparencia</li>\r\n<li>Eficiencia</li>\r\n<li>Eficacia</li>\r\n<li>Rendición de Cuentas</li>\r\n</ul>\r\n<p><br /><strong>Valores Institucionales Socialistas</strong></p>\r\n<ul>\r\n<li>Solidaridad</li>\r\n<li>Honestidad</li>\r\n<li>Corresponsabilidad Social</li>\r\n<li>Respeto</li>\r\n<li>Lealtad</li>\r\n<li>Equidad</li>\r\n<li>Justicia</li>\r\n<li>Igualdad</li>\r\n<li>Bien Común</li>\r\n<li>El ser social colectivo</li>\r\n</ul>', '', 1, 5, 0, 46, '2011-10-27 17:00:57', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-10-27 17:00:57', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 3, '', '', 0, 22, 'robots=\nauthor='),
(69, 'Somos SENIAT', 'somos-seniat', '', '<p style=\"text-align: justify;\"><strong>Antecedentes de la creación del Servicio Nacional Integrado de Administración Aduanera y Tributaria (SENIAT)</strong></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>El 21 de mayo de 1993</strong><br />Creación de Aduanas de Venezuela Servicio Autónomo (AVSA), como organismo sin personalidad jurídica, mediante Decreto Presidencial 2.937 de esa misma fecha, publicado en la Gaceta Oficial N° 35.216 del 21 de mayo 1993.<br />Sustituye en ese momento a la Dirección General Sectorial de Aduanas del Ministerio de Hacienda.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>23 de marzo de 1994</strong><br />Creación del Servicio Nacional de Administración Tributaria (SENAT), como servicio autónomo sin personalidad jurídica, según Gaceta Oficial N° 35.427 del 23 de marzo de 1994.<br />Esta dependencia sustituye a la Dirección General Sectorial de Rentas del Ministerio de Hacienda.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>El 10 de agosto de 1994</strong><br />Se fusionan Aduanas de Venezuela, Servicio Autónomo (AVSA) y el Servicio Nacional de Administración Tributaria (SENAT) para dar paso a la creación del Servicio Nacional Integrado de Administración Tributaria (SENIAT), según Decreto Presidencial N° 310 de fecha 10 de agosto de 1994, publicado en la Gaceta N° 35.525 de fecha 16 de agosto de 1994.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">El 1° de julio de 1994, entró en vigencia la Reforma Tributaria instrumentada por el Ejecutivo Nacional con fundamento en la Ley Habilitante de fecha 14 de abril de 1994, publicada en Gaceta Oficial N° 35.442 del 18 de abril de 1994. El proceso de fusión fue concebido como un proyecto de modernización orientado hacia un gran servicio de información con objetivos de incrementar la recaudación, actualizar la estructura tributaria nacional y fomentar la cultura tributaria, para fomentar el cumplimiento voluntario de las obligaciones de los contribuyentes.</p>', '', 1, 5, 0, 46, '2011-10-27 17:02:30', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-10-27 17:02:30', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 2, '', '', 0, 44, 'robots=\nauthor='),
(70, 'Misión y Visión', 'mision-y-vision', '', '<p style=\"text-align: center;\"><img src=\"images/stories/vision_mision.png\" border=\"0\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Misión</strong><br />Administrar eficientemente los procesos aduaneros y tributarios en el ámbito nacional y otras competencias legalmente asignadas, mediante la ejecución de Políticas Públicas en procura de aportar la mayor suma de felicidad posible y seguridad social a la Nación Venezolana.<br /> <br /> <br /><strong>Visión </strong><br />Ser una institución modelo, moderna, inteligente, acorde con el desarrollo socio económico del país, que fomente la cultura y garantice el cumplimiento de las obligaciones y deberes aduaneros y tributarios , contribuyendo a consolidar el Proyecto Socialista Bolivariano.</p>', '', 1, 5, 0, 46, '2011-10-27 17:03:17', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-10-27 17:03:17', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 1, '', '', 0, 24, 'robots=\nauthor='),
(71, 'Nuevo manual de Normas y Procedimientos de “Fondos de Caja Chica”', 'art-opp-not3', '', '<p><span style=\"color: #6e6e6e; font-family: Tahoma, Verdana, Arial, \'Courier New\', sans-serif; -webkit-border-horizontal-spacing: 2px; -webkit-border-vertical-spacing: 2px;\"> </span></p>\r\n<p style=\"margin-top: 0px; margin-bottom: 5px; text-align: justify;\">Cumpliendo instrucciones de la Jefa de la <strong>Oficina de Planificación y Presupuesto</strong> conjuntamente con su División de Organización, se informa que el Ciudadano Superintendente Nacional Aduanero y Tributario, aprobó mediante Punto de Cuenta 83 de fecha 20 de Octubre 2011 el Manual de Normas y Procedimientos Administrativo “<strong>Fondos de Caja Chica</strong>”.</p>\r\n<p> </p>\r\n<p>En este sentido, en el módulo de <strong>Descargas/Organización/Administrativos </strong>(<a href=\"phocadownload/Administrativos/Fondos_de_Caja_Chica.pdf\" target=\"_blank\">aquí</a>) se encuentra dicho documento, a los fines de su divulgación, distribución a las unidades y/o dependencias y para la ejecución de los procedimientos contenidos en el mismo para el presente ejercicio.</p>', '', 1, 4, 0, 37, '2011-10-28 00:00:00', 62, '', '2011-10-28 19:35:15', 62, 0, '0000-00-00 00:00:00', '2011-10-28 00:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 5, 0, 1, '', '', 0, 31, 'robots=\nauthor='),
(72, 'Información sobre el Foro “Formulación de Indicadores de Aduanas”', 'infoforo', '', '<p>La Oficina de Planificación y Presupuesto, informa la extensión del plazo hasta el día miércoles 21/12/2012; para el aporte de las observaciones y sugerencias por parte de las Aduanas Principales, sobre las propuestas de Indicadores del Proyecto Sistema Aduanero Socialista.</p>', '', 1, 4, 0, 25, '2011-12-20 18:45:09', 62, '', '2011-12-29 13:20:17', 62, 0, '0000-00-00 00:00:00', '2011-12-20 18:45:09', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 1, '', '', 0, 8, 'robots=\nauthor=');
