(1, '', 1307361600, '', 0, '', 1307478600, '', '', '', '', '', '<p>La Oficina de Planificación y Presupuesto se complace en dar inicio a la primera reunión sobre la Formulación del Plan y del Presupuesto 2012 en la G.R.T.I Región Zuliana. Las unidades invitadas para dicha reunión son:<br /><br /><br />Oficina de Relaciones Institucionales<br />Oficina del Centro de Estudios Fiscales</p>', 0, 0, 'G.R.T.I Región Zuliana', 0, '', 'Primera Reunión sobre la Formulación del Plan y del Presupuesto 2012', '', '', '', '', '', 0, 1, '2011-05-31 18:51:35', 1, 3, 0),
(2, '', 1310040000, '', 0, '', 1310070600, '', '', '', '', '', '<p style=\"text-align: center;\"><strong>Lineamientos Generales para la Formulación del Plan Operativo Anual y el Anteproyecto de Presupuesto 2012</strong></p>\r\n<p style=\"text-align: justify;\"><strong>Las unidades convocadas en la jornada fueron:</strong><br /> G.R.T.I. REGION CAPITAL<br /> S.T.I. VALLES DEL TUY<br /> S.T.I. LA GUAIRA<br /> S.T.I. GUARENAS GUATIRE<br /> S.T.I. LOS ALTOS MIRANDINOS<br /> S.T.I. BARUTA<br /> S.T.I. LIBERTADOR<br /> S.T.I HIGUEROTE<br /> G.R.T.I. CONT. ESP. REG. CAPITAL<br /> G.R.T.I. REGION CENTRAL<br /> S.T.I. MARACAY<br /> G.R.T.I. REGION CENTRO OCCIDENTAL<br /> G.R.T.I. REGION ZULIANA<br /> S.T.I. SANTA BARBARA DEL ZULIA<br /> S.T.I. CIUDAD OJEDA<br /> G.R.T.I. REGION LOS ANDES<br /> S.T.I. MERIDA<br /> S.T.I. BARINAS<br /> S.T.I. TRUJILLO<br /> S.T.I. LA FRÍA<br /> S.T.I EL VIGIA<br /> G.R.T.I. REGION NOR-ORIENTAL<br /> S.T.I. MATURÍN<br /> S.T.I. ANACO<br /> S.T.I CARUPANO<br /> S.T.I EL TIGRE<br /> G.R.T.I. REGION GUAYANA<br /> S.T.I. PUERTO ORDAZ<br /> G.R.T.I. REGION INSULAR<br /> G.R.T.I. REGION LOS LLANOS</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>AGENDA</strong></p>\r\n<p style=\"text-align: justify;\"><strong>8:30 a  9:00  a.m.<br /> </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Palabras de Apertura  a cargo de la Jefe de la Oficina de Planificación y Presupuesto. Econ. Nancy Matheus<strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>9:00  a 10:00 a.m. </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Presentación de la visión general del proceso de formulación de la Fase de     Fortalecimiento del Proyectos Sistema Tributario Socialista a cargo de la Oficina de Planificación y Presupuesto<strong> </strong></p>\r\n<p style=\"text-align: justify;\"><strong>10:00 a 11:00 a.m.</strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\"><strong> </strong>Presentación del Proyecto Sistema Tributario Socialista por parte de la Intendencia Nacional de Tributos Internos</p>\r\n<p style=\"text-align: justify;\"><strong>11:00 a 11:15 a.m</strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Refrigerio<strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>11:15 a 12:15 m. <br /> </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Continuación de la presentación del Proyecto Sistema Tributario Socialista<strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>12:15 a  1:30 p.m<br /> </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Almuerzo <strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>1:30 a 2:45 p.m.<br /> </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Presentación de la Política Presupuestaria Previa a cargo de las siguientes Unidades:<br /> Gerencia General de Tecnología y Comunicaciones<strong><br /> </strong>Oficina de Relaciones Institucionales<br /> Oficina Centro de  Estudios Fiscales <br /> Gerencia de Infraestructura<br /> División de Servicio<br /> División de Compras y Contratos <strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>2:45 a 3:30 p.m<br /> </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Presentación del Sistema  Auxiliar para la Formulación de Presupuesto SAFORPRE y el Sistema de Gestión de Metas SIGME <strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>3:30 a 4:00 p.m<br /> </strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Preguntas y Respuestas<strong><br /></strong></p>\r\n<p style=\"text-align: justify;\"><strong>4:00 a 4:30 p.m</strong></p>\r\n<p style=\"text-align: justify; padding-left: 30px;\">Clausura<strong><br /></strong></p>', 0, 0, '', 0, '', 'Primera Jornada de Trabajo con las Gerencias y Sectores de Tributos Internos ', '', '', '', '', '', 0, 1, '2011-07-07 15:23:36', 1, 15, 0),
