(993, 'j4age', 'string', '2011-10-univ', 0x31, 1320245926, 0, ' SELECT SQL_BIG_RESULT   COUNT(*) FROM   #__jstats_visits AS v   LEFT JOIN #__jstats_clients c ON (c.client_id = v.client_id) WHERE   c.client_type=0   AND ( v.changed_at >= 1317427200 AND v.changed_at <= 1320105599 ) GROUP BY   v.client_id'),
(1011, 'j4age', 'array', '', , 1325164603, 300, 'SELECT v.changed_at, count(*) as count\r\n             FROM #__jstats_visits as v\r\n             LEFT OUTER JOIN #__jstats_ipaddresses AS a ON (a.ip = v.ip)\r\n             LEFT OUTER JOIN #__jstats_clients AS c ON (c.client_id = v.client_id) \r\n            WHERE ( v.changed_at >= 1322697600 AND v.changed_at <= 1325375999 ) AND c.client_type = 1 AND ( v.changed_at >= 1322697600 AND v.changed_at <= 1325375999 )\r\n            GROUP BY DAYOFYEAR(FROM_UNIXTIME(v.changed_at))\r\n            ORDER BY v.changed_at ASC\r\n            '),
(1012, 'j4age', 'array', '', , 1325770173, 300, 'SELECT v.changed_at, count(*) as count\r\n             FROM #__jstats_visits as v\r\n             LEFT OUTER JOIN #__jstats_ipaddresses AS a ON (a.ip = v.ip)\r\n             LEFT OUTER JOIN #__jstats_clients AS c ON (c.client_id = v.client_id) \r\n            WHERE ( v.changed_at >= 1325376000 AND v.changed_at <= 1328054399 ) AND c.client_type = 1 AND ( v.changed_at >= 1325376000 AND v.changed_at <= 1328054399 )\r\n            GROUP BY DAYOFYEAR(FROM_UNIXTIME(v.changed_at))\r\n            ORDER BY v.changed_at ASC\r\n            ');
