INSERT INTO `jos_kunena_messages_text` (`mesid`, `message`) VALUES
(18, 'dsfdsf'),
(20, 'esta malo'),
(21, 'no estoy de acuerdo con esto por esto \r\nkklads\r\n\r\n\r\nads\r\nda\r\nd\r\nas\r\nd\r\nas'),
(22, 'estoy de acuerdo contigo'),
(26, 'La mesa política técnica conformada por la Intendencia Nacional de Tributos Internos, y las Gerencias de Recaudación y Fiscalización, la Oficina de Estadísticas y Estudios Económicos Aduanero y Tributario y la Oficina de Planificación y Presupuesto, exhortan a los participantes del foro, a trabajar  en el contexto del proyecto Sistema Tributario Socialista. A los fines de considerar los indicadores de gestión, los cuales se encuentran en el archivo adjunto, al igual que los Aspectos Generales del Foro y el Contexto Socio Político en el cual se formuló el Proyecto Tributario Socialista. En este sentido, se formulan las siguientes preguntas por grupo de consulta:\r\n\r\n1.¿Qué aspectos de los indicadores consideran necesario modificar, sustituir o incorporar?\r\n\r\n2.Basados en la experiencia de la fase Transición de los años 2010 y 2011, ¿Qué indicadores de gestión deben incorporarse? \r\n\r\n3.¿Cuáles son los argumentos para aceptar, modificar e incorporar indicadores de gestión  que midan el avance del proyecto?'),
(27, 'La mesa política técnica  en la sesión de trabajo del día viernes 2 de diciembre de 2011, definió la Recaudación Inducida como: \r\n\r\n\"La suma de los ingresos percibidos, como producto de la gestión de la Administración Tributaria, en los procesos de cobranza, control fiscal y ejecución de sentencias. Lo cual se traduce en la sumatoria de: Planillas efectivamente cobradas, intimaciones pagadas, resoluciones de imposición de sanción por omisos o morosos, actas de reparo, resolución de imposición de sanción por allanamiento, multas e intereses, resolución de recursos jerárquicos, sentencias ejecutadas por juicios ejecutivos y sentencias ejecutadas por recursos contencioosos favorables a la República atendiendo a la población objeto del Proyecto\".'),
(29, 'Estas son nuestras observaciones iniciales a los indicadores complementarios, les invitamos a revisarlos y hacer sus comentarios'),
(30, 'Estas son nuestras observaciones iniciales a los indicadores complementarios, les invitamos a revisarlos y hacer sus comentarios. Por razones técnicas no puedo adjuntar el archivo, el cual lo remitiré vía correo electronico a Región Capital y Región Central'),
(31, 'conincido con las observaciones formuladas con excepción de lo referido a comunidaes organizadas, siendo que su ejecución puede efectuarse perfectamente en el mismo período.\r\nyo aún estoy revisando con los jefes de sector, seria bueno que extendieran el foro al día lunes. \r\npor otra parte considero que se debe crear un indicador de economía referido a cobro de deudas donde se refleje el monto de lo recaudado, no obstante lo presentaré en el documento general que se presente por esta región'),
(32, 'Buenas tardes compañeros enlaces de Planificación,\r\n\r\nA los fines de elaborar la compilación de los acuerdos y desacuerdos sobre los indicadores de gestión formulados para medir el avance del proyecto, solicito me remitan las propuestas desarrolladas por sus Gerencias respectivas.\r\n\r\nSolicitud que hago en virtud a las instrucciones contenidas en el memorando SNAT/OPP/2011/2150 de fecha 02/12/2011 emanado de la Oficina de Planificación y Presupuesto, mediante el cual se me asignan las funciones de modelador y coordinador del Foro de consulta Eje Occidental.\r\n\r\natentamente,\r\n\r\nLeonardo Chacón M.\r\nCoord. Unidad de Control de Gestión y Planificación\r\nGerencia de Tributos Internos Región los Andes\r\nTlf. (0276) 3409209 Cel. 0414 7076109\r\nEmail. lchacon@seniat.gob.ve'),
(33, 'Un saludo. Marcos, te comento que cuando se redacta un mensaje en el foro, al adjuntar un archivo, el mismo no se muestra al instante, si no luego de enviar el mensaje. Es por eso que en el primer mensaje de este tema SI se adjuntó el excel.\r\n\r\nPor otro lado, recuerden por favor que la propuesta \"unica\" del eje debe estar elaborada y presentada en el foro antes del lunes a las 10.00am.\r\n\r\nDe antemano muchas gracias....'),
(34, 'Aceptada la observación de Comunidades Organizadas y adjuntamos algunas observaciones a los indicadores de recaudación'),
(35, '[quote=\"JRIVASA\" post=31]conincido con las observaciones formuladas con excepción de lo referido a comunidaes organizadas, siendo que su ejecución puede efectuarse perfectamente en el mismo período.\r\nyo aún estoy revisando con los jefes de sector, seria bueno que extendieran el foro al día lunes. \r\npor otra parte considero que se debe crear un indicador de economía referido a cobro de deudas donde se refleje el monto de lo recaudado, no obstante lo presentaré en el documento general que se presente por esta región[/quote]\r\n\r\nHola Janeth. Buena idea lo del indicador de economía. Por favor elabora la propuesta mediante los mismos cuadros donde enviamos los indicadores sugeridos. Recuerda por favor los atributos de los indicadores, en este sentido, comprueba que el mismo pueda ser medible, dentro del contexto del Proyecto y con unidades de medida existentes o controlables.'),
(36, 'Ramón, \r\n\r\nEstimaría mucho que consideren extender la fecha, tomando en cuenta que apenas ayer en la tarde llegó la comunicación a esta región, lo cual requiere de una logistica para la reunión con los jefes de división y luego para la discusión con los integrantes de nuestro eje. \r\nDe otra manera sería demasiado precipitado lo cual puede inducir a incongruencias o fallas debido a la premura. \r\nhe observadoo que aún el resto de los Ejes no han ingrasado al chat ni han planteado propuestas.\r\nEspero eleves esta solicitud y sea aceptada. \r\nPor otra parte, recuerden que los primeros de mes son días complejos por la consolidación y revisión del SIGER y la elaboración del Informe de Gestión el cual se ve afectado en el tiempo de entrega en vista de estos nuevos requerimientos que son de vital importancia. \r\nmil gracias.'),
(37, '[quote=\"MPRIETO\" post=30]Estas son nuestras observaciones iniciales a los indicadores complementarios, les invitamos a revisarlos y hacer sus comentarios. Por razones técnicas no puedo adjuntar el archivo, el cual lo remitiré vía correo electronico a Región Capital y Región Central[/quote]\r\n\r\nSaludos. Con respecto al Sumario Administrativo, efectivamente y en razón a la sugerencia de Auditoría, se cambió el término de \"acceptada\" por \"pagada\". El indicador de esta unidad de medida se contabilizará mediante las Resoluciones Culminatorias de Sumario \"pagadas\"...'),
(38, '[quote=\"JRIVASA\" post=36]Ramón, \r\n\r\nEstimaría mucho que consideren extender la fecha, tomando en cuenta que apenas ayer en la tarde llegó la comunicación a esta región, lo cual requiere de una logistica para la reunión con los jefes de división y luego para la discusión con los integrantes de nuestro eje. \r\nDe otra manera sería demasiado precipitado lo cual puede inducir a incongruencias o fallas debido a la premura. \r\nhe observadoo que aún el resto de los Ejes no han ingrasado al chat ni han planteado propuestas.\r\nEspero eleves esta solicitud y sea aceptada. \r\nPor otra parte, recuerden que los primeros de mes son días complejos por la consolidación y revisión del SIGER y la elaboración del Informe de Gestión el cual se ve afectado en el tiempo de entrega en vista de estos nuevos requerimientos que son de vital importancia. \r\nmil gracias.[/quote]\r\n\r\nBueno, la consulta según la planificación, estaba pautada para los días 6, 7 y 8. La misma se extendió, para la elaboración de la propuesta final, para el lunes antes de las 10.00am.\r\n\r\nPor otro lado, el documento final emitido por la mesa de trabajo, considerando las propuestas de las Gerencias Regionales de Tributos Internos (una por cada eje), debe estar listo, firmado y sellado, el miercoles de la semana que viene.'),
(39, 'En pro de contribuir con el avance de esta institución que se traducirá en el beneficio de toda la colectividad, a continuación se exponen los puntos mas relevantes para el Área de Cobranza:\r\n\r\n\r\n1. ¿Qué aspectos de los indicadores consideran necesario modificar, sustituir o incorporar?\r\n\r\nRespecto a que aspecto se considera que se debe modificar, sustituir o cambiar, es propicia la oportunidad para indicar, tal y como se ha venido haciendo en los informes de gestión mensuales, que el Indicador Acta de Intimación Pagada no es el correcto para medir la Gestión de Cobranza Extrajudicial, ya que a nuestro juicio el Acta de Intimación se debe emitir y notificar una vez agotadas las gestiones de cobranza extrajudicial, es de hacer notar que entre las gestiones de cobranza extrajudicial se encuentra la notificación de Actas de Cobro, Telegramas, Correos Electrónicos entre otras, a juicio del ejecutivo de cobro, por otra parte se debe mencionar que el numeral 4 del articulo 212 establece que se le debe indicar al contribuyente que cuenta con 5 días hábiles para su pago y de lo contrario se procederá a la iniciación del juicio ejecutivo, ahora bien, si agotadas la vía extrajudicial y observada la negativa por parte del contribuyente a realizar el pago, lo correcto es iniciar la investigación patrimonial, ya que es exigido por parte de la División Jurídica Tributaria, al igual que el Acta de Intimación Notificada, para iniciar el correspondiente juicio ejecutivo.  \r\n\r\nEn el mismo orden de ideas se puede decir que la notificación del Acta de Intimación no es indicativo de que el contribuyente realizara el pago, además de que el procedimiento de Investigación Patrimonial es lento por la cantidad de tramites que se deben efectuar lo que permite, en muchos casos que el contribuyente se insolvente.  Adicionalmente se puede decir que el responsable de mostrar los resultados de este indicador debe ser la División Jurídica Tributaria, ya que es esta quien se encarga del Juicio Ejecutivo y por ende la mayor parte de los pagos son ya en la via judicial. \r\n\r\n\r\n2. Basados en la experiencia de la fase Transición de los años 2010 y 2011, ¿Qué indicadores de gestión deben incorporarse? \r\n\r\nEl indicador que debe incorporarse es “Acta de Cobro Efectivamente Pagadas”, y las razones son las mismas que se exponen en la pregunta anterior.\r\n\r\n3. ¿Cuáles son los argumentos para aceptar, modificar e incorporar indicadores de gestión que midan el avance del proyecto?\r\n\r\nLos argumentos se exponen en la respuesta numero 1.'),
(40, 'Buenas tardes, por favor necesito que aclares una duda referente a:\r\n\r\nAcción específica: Sustanciar el Sumario Administrativo, \r\nUnidad de medida: Resolución Culminatoria de Sumario Pagadas, respecto a esta unidad de medida, se indica que tiene que ser reportada de forma mensual, ahora bien, como se hace con el lapso de espera de los 25 días hábiles que establece el código para que el contribuyente introduzca su escrito de descargo?.\r\n\r\nPor otra parte, para el año 2012 se pueden reportar durante los 2 o 3 primeros meses, casos del año inmediato anterior (2011), específicamente casos que estén en el lapso de espera del escrito de descargo? \r\n\r\nAsimismo se puede observar, que existe una incongruencia en la formula del calculo del indicador, por cuánto al efectuarse la división de la cantidad de Resoluciones Culminatoria de Sumario de Fiscalizaciones Puntuales Pagadas, entre la cantidad de Resoluciones Culminatoria de Sumario de Fiscalizaciones Puntuales Notificadas, ésta operación arrojará un resultado como máximo del 100%, puesto que las Resolciones Culminatorias Pagadas nunca podrán superar la cantidad de Resoluciones Culminatorias Notificadas en el mismo, razón por la cual por lo general, se estará evaluando por debajo del 100% de cumplimiento. \r\n\r\nPor tal motivo se sugiere reformular o evaluar el indicador o agregar un tabulador con rangos, por ejemplo; 100% -76% Excelente, 75% -51% bueno, 50%-26% regular, 25%-0% deficiente.\r\n\r\nGracias por la colaboración prestada.\r\n\r\n\r\nSunayda Acosta\r\nGRTI Región Los Llanos\r\nCoord. Oficina de Planificación'),
(41, 'Buenas tardes, me parece pertinente que hayan decidido extender la fecha del foro.\r\n\r\nSaludos Cordiales,\r\n\r\nSandra Pontón'),
(42, 'Buenas tardes\r\n\r\nSugiero que se verifique la formula de este indicador, por cuanto como esta planteado: \r\n(Cantidad de Actas de Reparo Notificadas de fiscalizaciones puntuales ejecutadas) / (Cantidad de Actas de Conformidad Notificadas de Fiscalizaciones Puntuales Programadas + Cantidad de Actas de Reparo Notificadas de fiscalizaciones puntuales ejecutadas)  x 100 \r\n\r\nY luego de despejar los termino que coinciden quedaría de la siguiente manera:\r\n\r\n1 / (Cantidad de Actas de Conformidad Notificadas de Fiscalizaciones Puntuales Programadas)  x 100\r\n \r\nlo que podría general un error matemático por cuanto si no se tenían programadas actas de conformidad en el mes el valor seria infinito y si se tienen mas de 1 acta de conformidad la ejecución seria desfavorable.'),
(43, 'Buenas tardes.\r\n\r\n\r\nEn representacion de la Oficina de Planificaciòn de la Gerencia Regional de Tributos Internos Regiòn Centro Occidental, me dirijo a uste en la oportunidad de participarle que aun no tenemos una Propuesta definida, debido a que cada coordinador esta analizando los indicadores respectivos, en vista de que los primeros dias de cada mes los funcionarios involucrados estan abocados a la realizaciòn de los diferentes informes mensuales (SIGER, GESTION, y Actividades Relevantes), es por ello que se deberìa plantear una nueva fecha para continuar con el Foro.\r\n\r\n\r\nEstamos dispuesto a colaborar y presentar nuestras observaciones sólo pedimos un poco mas de tiempo por las razones antes planteadas.\r\n\r\n\r\nSaludos cordiales\r\n\r\nALEJANDRO ALVARADO\r\n0251-2301973'),
(44, 'Buenas tardes,\r\n\r\nAnexo publicamos las sugerencias y observaciones a los indicadores de gestión presentados por la Oficina de Planificación y Presupuesto, esperamos recomendaciones y comentarios a los mismos por las personas involucradas.\r\n\r\nGracias;\r\n\r\nMiguel Carmona\r\nPlanificación RNO'),
(45, 'Buenos días, Lic. Leonardo Chacón.\r\n\r\nSolicito sus buenos oficios a los fines de realizar una petición de extensión del plazo para presentar las opiniones referentes a los indicadores de gestión; por cuanto el área de planificación y estadísticas de la Región Zuliana, está esperando los aportes de las Divisiones, Sector y Unidades, responsables de producir e informar los datos del Plan Tributario Socialista.\r\n\r\n\r\nFernando José Jiménez Puche\r\n0261-7962206\r\n0416-8605617'),
(46, 'lo que me ha llamado la atención de la propuesta que remitió la oficina de planificación es que el 95 % de los indicadores es referido simplemente a cumplimiento.'),
(47, 'CONSIDERO QUE DEBE EFECTUARSE UNA REVISIÓN DE LOS CONCEPTOS UTILIZADOS, SIENDO QUE LOS MISMOS TIENDE A CREAR CONFUSIÓN Y REDUNDAR. \r\nUN EJEMPLO DE ELLO ES:  \" Cantidad de Actas de Reparo Notificadas de fiscalizaciones puntuales ejecutadas\"\r\n ES REDUNDANTE INDICAR QUE SE TRATA DE FISCALIZACIONES PUNTUALES EJECUTADAS. SI NO SE HUBIERAN EJECUTADO NO SURGIRIA EL ACTA DE REPARO, Y LAMENTABLEMENTE ELLO A GENERADO CONFUSIÓN AL MOMENTO DE LA DISCUSIÓN CON LOS GRUPOS DE TRABAJO.'),
(48, 'buen día, \r\nConsidero que la solicitud de extensión de tiempo para la formulación de indicadores es un clamor de todas las Gerencias Regionales. Si hemos esperado casi 2 años para que esto se llevara a cabo unos días mas no hacen la diferencia. Por otra parte hay que tener en consideración que estos indicadores una vez definido no podrán ser sustituidos.'),
(49, 'Estimados compañeros, adjunto archivo con las observaciones propias de la Región Central.\r\n\r\nEsperamos sean de ayuda, para mejorar la calidad de los indicadores de gestión, instrumentos que medirán realmente la efectividad y eficacia de las actividades que realizamos día a día.\r\n\r\nSaludos cordiales,\r\n\r\nJanerey'),
(50, 'Buenas Tardes,\r\n\r\nA continuación exponemos las observaciones y sugerencias levantadas por la Región los Andes, sobre los indicadores de Gestión propuestos, a los fines de la consideración, análisis y comentarios respectivos por parte de las Gerencias que integran el eje occidental.\r\n\r\nI Relacionados con la acción específica Practicar Fiscalizaciones:\r\n\r\nIndicador: Eficacia  de  las Actas de Reparos Aceptadas\r\nObservación: Consideramos que la formulación de este indicador esta mas orientado a la tipología de “Calidad”, por cuanto muestra la conformidad por parte del contribuyente al reparo efectuado, así como la efectividad y certeza tanto en los procesos de selección o análisis previo como en los de determinación propiamente dichos. En tal sentido sugerimos cambiar el tipo y la denominación de este indicador por “Calidad en las Actas de Reparo Notificadas”\r\n\r\n\r\nIndicador: Calidad de las fiscalizaciones puntuales efectuadas.\r\nObservación: Consideramos que el denominador de la formula debería estar conformado por la sumatoria de las Actas de Reparo Notificadas de fiscalizaciones puntuales ejecutadas y las Actas de Conformidad Notificadas de Fiscalizaciones Puntuales ejecutadas. Asimismo  sugerimos cambiar la denominación de este indicador por “Efectividad en las Fiscalizaciones Puntuales”\r\n\r\n\r\nII Relacionados con la acción específica Sustanciar el Sumario Administrativo:\r\n\r\nIndicador: Eficacia de las  Resoluciones Culminatorias de Sumario Administrativo de Fiscalizaciones Puntuales pagada\r\nObservación: No obstante a que el indicador cumple con el atributo de ser “medible”, en la práctica o en la ejecución de los procesos a nivel operativo, requieren de un seguimiento diario y en forma manual, para verificar y constatar el pago de todas las planillas de liquidación asociadas a una Resolución Culminatoria del Sumario, esto en razón a que la administración tributaria no cuenta con un sistema o herramienta automatizada que encause todos los  procedimientos tributarios y que permita en consecuencia consultar en forma masiva y en tiempo real, las Resoluciones Culminatoria del Sumario que han sido pagadas dentro de un periodo determinado. En tal sentido y en nuestra opinión, este indicador adolece de la cualidad de accesibilidad, por cuanto la información no es de fácil obtención y requieren de un volumen de horas-hombres  poco productivas.\r\n\r\n\r\nII Relacionados con la acción específica Cobro de Deudas Tributarias:\r\n\r\nIndicador: Eficacia de las Actas de Intimación Pagadas\r\nObservación: Aplica la misma observación del indicador anterior, salvo que en este caso el problema de accesibilidad proviene del origen, es decir, no corresponde al indicador sino a la unidad de medida de la acción especifica. Adicionalmente consideramos que el objetivo que persigue el indicador no debe estar condicionados por factores externos, tales como el accionar a terceros, que en este caso se traduce en la voluntad por parte del contribuyente, de pagar en atención al procediendo de intimación de derechos pendientes (esta última consideración aplica también para el indicador Eficacia sobre las Planillas Efectivamente Cobradas).\r\n\r\n\r\nII Indicadores Globales:\r\n\r\nIndicador: Recaudación Inducida\r\nObservación: Consideramos que no es adecuada la formulación o determinación de la formula, por cuanto el utilizar como base la recaudación Inducida del mes anterior para este indicador, supone que para lograr un resultado positivo, deba existir un incremento intermensual permanente de la recaudación por este concepto, lo cual supondría igualmente que la capacidad operativa no tendría entonces limites y “la población objetivo” seria inagotable, además de plantearse un escenario de persistencia de la conducta infractora de los contribuyentes, circunstancia que es contraria al fin ultimo que persigue el control fiscal por parte de la administración tributaria, el cual no es otro que el cumplimiento voluntario de todas las obligaciones tributarias por parte de los sujetos pasivos.'),
(51, 'Buenos días, sirva la presente para saludar y a su vez remitr las observaciones realizadas a los indicadores por parte de las GRTI que conforman este eje, las cuales son Regíón Los Llanos y Región Guayana.\r\n\r\nObservaciones Región Los Llanos\r\n\r\n\r\nDivisión de Sumario Administrativo\r\n\r\n1)	¿Qué aspectos de los indicadores consideran necesario modificar, sustituir o incorporar?\r\n\r\nA la luz de la propuesta hecha en la matriz base para el nuevo diseño del indicador, en la cual se incorporará:\r\n\r\nEficacia de las Resoluciones Culminatorias de Sumario Administrativo de Fiscalizaciones Puntuales pagadas. \r\n\r\nSiendo así, cabe formular  la siguiente pregunta: ¿a partir de que mes es obligatorio llenar este renglón? Ya que considero que los meses de enero y febrero estarán en cero, debido a que se debe tomar en cuenta que esta información se tomará es con respecto a las Resoluciones Culminatorias de Sumario Administrativo de Fiscalizaciones Puntuales pagadas del 2012, por lo tanto será imposible el pago de las mismas en esos meses (enero y febrero) ya que hay que respetar el derecho del contribuyente si desea ejercer el Recurso Contencioso Tributario, conjunta o separadamente del Recurso Jerárquico, dentro del plazo de veinticinco (25) días hábiles contados a partir de la notificación de la presente Resolución, bien ante el Tribunal competente, o por ante el Juez con competencia territorial en el domicilio fiscal del contribuyente o ante la Gerencia conforme a lo establecido en los artículos 260, 261 y 262 del Código Orgánico Tributario.\r\n\r\n2) ¿Cuáles son los argumentos para aceptar, modificar e incorporar indicadores de gestión que midan el avance del proyecto?\r\n\r\nEn mi opinión frente al planteamiento hecho anteriormente considero, que será bien acogida dicha incorporación siempre y cuando, la información sea obligatoria incluirla a partir del mes de marzo.\r\n\r\n\r\nDivisión de Fiscalización \r\n\r\nIndicador: Eficacia de las Actas de Reparos Aceptadas\r\n\r\nEn relación con este indicador, se puede observar, que existe una incongruencia en la formula del calculo del indicador, por cuánto al efectuarse la división de la cantidad de Actas de Reparos aceptadas totales o parciales por fiscalizaciones puntuales ejecutadas,  entre la cantidad de Actas Notificadas por Fiscalizaciones Puntuales,  ésta operación arrojará un resultado como máximo del 100%, puesto que las Actas de Reparos Aceptadas  nunca podrán superar la cantidad de actas notificadas en el mismo, razón por la cual por lo general, se estará evaluando por debajo del 100% de cumplimiento. \r\n\r\nPor tal motivo se sugiere reformular o evaluar el indicador o agregar un tabulador con rangos, por ejemplo; 100% -76% Excelente, 75% -51% bueno, 50%-26% regular, 25%-0% deficiente. \r\n\r\nLa otra sugerencia es medir las Actas de Reparos aceptadas totales o parciales por fiscalizaciones puntuales ejecutadas, entre las Actas de Reparos aceptadas totales o parciales por fiscalizaciones puntuales Programadas, el único inconveniente es que estas ultimas no se solicito de la oficina de planificación para su estimación, es decir, que en el POA no se contempló la programación de Actas de Reparo Aceptadas total o parcialmente y las mismas deberían incluirse.\r\n\r\n\r\nIndicador: Calidad de las Fiscalizaciones Puntuales Efectuadas\r\n\r\nEn la formula del indicador es importante considerar, que si dividimos la Cantidad de Actas de Reparo Notificadas de fiscalizaciones puntuales ejecutadas, entre la suma de la cantidad de Actas de Conformidad Notificadas de Fiscalizaciones Puntuales Programas en el mismo, más la Cantidad de Actas de Reparo Notificadas de fiscalizaciones puntuales ejecutadas en dicho mes, estaremos evaluando por lo general, por debajo del 100% o un máximo de 100%, por cuanto la cantidad de actas de conformidad forman parte de la cantidad de actas notificadas, razón por lo cual siempre el denominador resultará igual o mayor que el numerador, lo que arrojará resultado que nunca superará el 100%. \r\n\r\n\r\nPor tal motivo de igual forma se sugiere reformular o evaluar el indicador o agregar un tabulador con rangos, por ejemplo; 100% - 76% Excelente, 75% - 51% bueno, 50% - 26% regular, 25% - 0% deficiente. \r\n\r\nPara obtener el resultado de este indicador si se posee la información necesaria incluida en el POA, pero debe medirse por rango de eficiencia y no por sobrecumplimeinto debido a que estadísticamente este indicador no podrá ser superior al 100%.\r\n\r\n\r\nIndicador: Eficacia de las Actas de Reparo Notificadas de Fiscalizaciones Puntuales y \r\n\r\nEficacia de las Resoluciones de Imposición de Sanción e Intereses moratorios por Fiscalizaciones Puntuales\r\n\r\n\r\nLa División de Fiscalización con respecto a los  indicadores descritos, no posee discrepancia y encuentra en total acuerdo, puesto que  observa que la formula coincide con el propósito de medir el incumplimiento, cumplimiento o sobrecumplimeinto de las metas asignadas, está  enmarcado en el POA 2012, remitido por esta División y cumple con el objetivo referente al Proyecto Sistema Tributario Socialista.\r\n\r\n\r\n\r\nDivisión de Asistencia al Contribuyente\r\n\r\nSe tiene que la Acción Específica de Formar Sujetos Pasivos y Comunidades sobre normas tributarias asignada se ajusta completamente al fin primordial de la División de Asistencia al Contribuyente la cual tiene entre sus funciones:\r\n\r\n•	Coordinar las actividades dirigidas a la orientación, adiestramiento y enseñanza dirigida a concientizar a los contribuyentes; \r\n\r\n•	Programar las actividades de educación tributaria, especialmente aquellas que tiendan a crear una conciencia cívico-tributaria, propender por su implantación y velar por la ejecución; \r\n\r\nDe igual forma se considera que dicha matriz se mantiene acorde con el Plan Nacional Simón Bolivar 2007-2013 en cuanto a los objetivos que el mismo nos plantea y también con el Sistema Tributario Socialista que avanza en la institución al incorporar mediante acción especifica a las Comunidades Organizadas.  \r\n\r\n\r\nDivisión de Recaudación\r\n\r\nAl respecto nuestra apreciación coincide con la matriz base para el diseño de los indicadores antes mencionados, por lo que no hay ninguna disconformidad al respecto, sin embargo es nuestro deber informar que la herramienta de los Omisos aun no se encuentra activada, este hecho es preocupante ya que debemos estar en este momento manipulando dicha herramienta para prever cualquier inconveniente que se nos pueda presentar y de esta manera poder cumplir con la programación estimada, y lo que si llama la atención es que no esta incluido el indicador de la unidad de medida de Contribuyentes con Deuda Consolidada.\r\n\r\n\r\nIndicadores\r\n•	Acta de Intimación Pagada\r\n•	Planillas Efectivamente Cobradas\r\n•	Contribuyente con Deuda Depurada\r\n•	Auxiliar Contable\r\n•	Registro por Municipio y actividad Económica\r\n•	Contribuyente con registro Depurado\r\n•	Recaudación Inducida\r\n•	Resolución de Imposición de Sanción de Contribuyentes Omisos y/o Morosos\r\n•	Notificaciones de Omisos\r\n\r\n\r\nDivisión de Administración \r\n\r\nCon respecto a los indicadores de gestión establecidos a la Gerencia, si estoy de acuerdo debido a que hemos ejecutado nuestro presupuesto asignado en el año 2010 y en el 2011, ajustándonos a los criterio de austeridad y respetando las normas y procedimientos emanado por las máximas autoridades de esta Institución, sabiendo llevar los gastos y cubrir las necesidades de esta Región.\r\n\r\nEn este orden de ideas, considero que los indicadores de Gestión planteados por ustedes, son acorde al avance del proyecto que se quiere lograr.\r\n\r\n\r\nObservaciones Región Guayana\r\n\r\nBuenas tardes, con relación a las observaciones sobre los Indicadores de Gestión del Proyecto Tributario Socialista, hago las siguientes:\r\n\r\n1.	Eficacia de las  Resoluciones Culminatorias de Sumario Administrativo de Fiscalizaciones Puntuales notificadas: \r\n\r\nSe sigue insistiendo en el mismo error, de los años anteriores; por cuanto se trata de medir el rendimiento de una unidad administrativa, bajo un indicador que no depende funcionalmente de ésta; me explico, la División de Sumario Administrativo se encarga principalmente de emitir los Actos Administrativos producto de un procedimiento de Fiscalización y Determinación, en el cual la contribuyente no se allanó o lo hizo de forma parcial; a quien le compete la notificación de estos actos es a la División de Tramitaciones, si quieres medir la eficacia en las notificaciones debes incluirle este indicador a la División de Tramitaciones haciéndole una segregación de cada acto que debe notificar; porque vamos a seguir incurriendo en lo que nos ha venido pasando, nos hemos visto en la necesidad de modificar los informes mensuales desde Agosto hasta Noviembre porque la información sobre las notificaciones llega posterior a la fecha de carga al sistema. La División de Sumario debe medirse por la cantidad de Resoluciones que se emiten sin inconsistencias. \r\n\r\n2.	Eficacia de las  Resoluciones Culminatorias de Sumario Administrativo de Fiscalizaciones Puntuales pagada: \r\n\r\nSin la División de Sumario no tiene dentro de sus funciones la notificación de sus actos, mucho menos los tiene en la gestión de cobro, aún cuando se hable de un cobro inducido, nosotros no somos los que manejamos los reportes para verificar cual Planilla de Liquidación se casó con la Resolución X, y mucho menos cual  contribuyente ejerció alguna acción administrativa o contenciosa; esa información la manejan las Divisiones de Recaudación y las Divisiones Jurídico Tributaria; a menos que se implemente un Sistema Integrado de Control, donde se pueda seguir desde cada unidad administrativa el recorrido de sus actos, de manera tal que al final de cada mes se puede emitir el reporte correspondiente, y el trabajo de cada Jefe de División sea la de ejercer un Control Posterior de sus actuaciones, mediante la revisión de las actuaciones de las Divisiones responsables en la ruta ordinaria del expediente; mientras tanto, al igual que el item anterior, se sugiere incorporar este indicador tanto para la División de Recaudación en su gestión de Cobros (Cuantas Planillas generadas por una Resolución de Sumario se cobraron o fueron canceladas), como por la División Jurídica Tributaria. \r\n\r\nConsidero que debe terminar de entenderse, que cada Gerencia Regional forma parte de un organismo denominado SENIAT; no obstante, cada unidad administrativa tiene una función y por ende una responsabilidad, la cual debe ser el objeto de las mediciones; para poder evaluar el rendimiento de cada una, y aplicar los correctivos pertinentes; pero midiéndola bajo parámetros que escapan de la función de cada una, estamos caminando por el camino equivocado, porque los actos  administrativos van a salir, y las actividades inherentes a los procedimientos se cumplirán,  pero no van a poder ser plasmado en los reportes mensuales.\r\n\r\n\r\nDivisión de Recaudación \r\n\r\nSe remite propuestas u observaciones realizadas a los Indicadores de Gestión presentados por la Oficina de Planificación y Presupuesto, basado en las siguientes interrogantes:\r\n\r\n1.	¿Qué aspectos de los indicadores consideran necesario modificar, sustituir o incorporar?\r\n\r\nNombre de la Acción Específica, objetivo e impacto	Acción Específica: Cobro de Deudas Tributarias, Unidad de medida: Acta de Intimación Pagada\r\nNombre del Indicador	Eficacia de las Actas de Intimación Pagadas\r\n\r\nTomar en cuenta la Gestión de Cobranza realizada, como el Indicador a ser sustituido por  ACTA DE COBRO y no el pago como el Indicador\r\n\r\nA MODIFICAR:\r\nNombre de la Acción Específica, objetivo e impacto	Acción Específica: Cobro de Deudas Tributarias, Unidad de medida: Acta de Cobro\r\nNombre del Indicador	Eficacia de las Actas de de Cobro\r\n\r\nA MODIFICAR:\r\nNombre de la Acción Específica, objetivo e impacto	Acción Específica: Cobro de Deudas Tributarias, Unidad de medida: Auxiliar Contable\r\nNombre del Indicador	Eficacia sobre los Auxiliares Contables\r\n\r\nTomar en cuenta como indicador los Auxiliares Contables de las Rentas: IVA, ISLR, SUCESIONES (AUTOLIQUIDACIONES) y TIMBRES; a partir del año 2010.\r\n\r\nAUXILIARES CONTABLES, Este indicador no cumple con los principios de Contabilidad, por cuanto existe disparidad en la información, debido a que las liquidaciones que se deben registrar en le auxiliar contable son las que están notificadas.\r\n\r\nCon relación a los Auxiliares Contables, es oportuno informar que en esta Región solo se manejan las Rentas de IVA, ISLR, SUCESIONES (EN AUTOLIQUIDACIONES, LIQUIDACIONES Y RECAUDACIONES) y TIMBRES (SOLO EN LOS CASOS DE AUTOLIQUIDACIONES Y RECAUDACIONES), en el caso de los Auxiliares de la Región Guayana actualmente en la información que es reportada en el Cuadro SIGER 18, solo se están tomando las liquidaciones manuales emitidas mensualmente, en razón de ello se presenta la siguiente inquietud:\r\n\r\nActualmente en el Área de Liquidación y Contabilidad se están elaborando los Auxiliares Contables de estas Rentas a partir  del año 2010, de acuerdo al modelo enviado por la Gerencia de Recaudación y por la Oficina de Auditoria Interna, sin embargo como las cuentas de los años del 2005 al 2009 no se habían participado ni se habían presentado, se tuvieron que ajustar a las nuevas normativas; en tal sentido mensualmente se están elaborando estos Auxiliares; sin embargo nos informaron que en el Cuadro SIGER Nº 18 solo va a ir cargada la información que se genere de las liquidaciones emitidas en el mes y no el de las liquidaciones pertenecientes a meses y años anteriores.\r\n\r\nAhora bien, a nuestro parecer existe disparidad en cuanto a esta información, por cuanto las liquidaciones que se deben relacionar en el Auxiliar Contable son aquellas que pueden pertenecer a cualquier año y ya están notificadas (así lo exige la normativa legal), sin embargo las que se están reportando actualmente no están notificadas en su totalidad y solo corresponden al mes y año en que se elabora el auxiliar; no se ha entendido muy bien que información va a ser cargada en el Cuadro SIGER Nº 18, aunque se ha elaborado pero con dudas.\r\n\r\n\r\n2.	Basados en la experiencia de la fase Transición de los años 2010 y 2011, ¿Qué indicadores de gestión deben incorporarse? \r\n\r\nNo se tienen nuevos indicadores a incorporar.\r\n\r\n3.	¿Cuáles son los argumentos para aceptar, modificar e incorporar indicadores de gestión  que midan el avance del proyecto?\r\n\r\nACTA DE INTIMACION PAGADA, con la medición de este indicador se ha determinado que tal como esta definido no permite cumplir con lo esperado, observando los históricos.\r\n\r\nUn Acta de Intimación, se realiza cuando el Contribuyente ya se comprobó que no va a pagar, agotada la vía administrativa, se realiza la INTIMACION, para proceder previa Investigación Patrimonial e iniciar el cobro judicial, en este sentido no se pueden realizar Intimaciones sin agotar la vía  administrativa, al referirnos que no se CUMPLE CON LO ESPERADO, queremos decir que no se logra realizar la medición de la Gestión de cobranza ya que si se observan los históricos no se han realizado  Intimaciones Pagada, por que se realiza la gestión a través de un acta de Cobro.\r\n\r\nCon relación a los indicadores de la División de Fiscalización la funcionaria designada remitió no tienen observaciones ni solicitud de modificaciones al respecto, esta de acuerdo con lo planteado por la Oficina de Planificación.\r\n\r\nEl indicador de Comunidades Organizadas tampoco tiene observaciones en el indicador, esta de acuerdo con el planteado.\r\n\r\nCon relación al Indicadores de Ejecución Presupuestaria el mismo se encuentra sin observaciones.\r\n\r\n\r\nSin otro particular, \r\n\r\n\r\nSaludos,\r\n\r\n\r\nSunayda Acosta\r\nCoord. Eje Orinoco - Apure'),
(52, 'Con la finalidad de suministrar nuestro aporte a la actividad propuesta por la Oficina de  Planificación y Presupuesto denominada foro “Formulación de Indicadores de Gestión 2012 – Tributos Internos”,   cuyo objetivo primario es consolidar unos indicadores de gestión que se correspondan con las Acciones Especificas y sus unidades de medida.\r\nEn la Región NorOriental se procedió a la realización de mesas de trabajo donde se elevó la consulta y solicitó la participación de funcionarios de las diversas unidades operativas, responsables de las Acciones Específicas, y encargadas de generar la información correspondiente al SIGER a fin de consultarles su opinión con respecto a las unidades de medida que cada uno ha de manejar en el momento de procesar la información, en lo relativo a, si en su criterio estos instrumentos están cumpliendo a cabalidad su función,  están cumpliendo con el objetivo para el cual fueron diseñados. De estas reuniones se desprendieron estas sugerencias.\r\nFinalmente, se realizó consulta de unificación con la Región Insular, surgiendo así la propuesta definitiva que acompaña este tema.\r\n\r\nMiguel Carmona\r\nCoordinador de Planificación\r\nRegión  NorOriental\r\n\r\nLewis Mujica\r\nCoordinador de Planificación\r\nRegión  Insular'),
(53, 'Buenos días, en este documento tratamos de incorporar todas las observaciones realizadas por las Gerencias de Región Capital, Región Central y Contribuyentes Especiales'),
(54, 'Buenos días, siguiendo instrucciones del ciudadano Gerente Regional, Lic. Leonardo Castellano, cumplo con remitir para su consideración como líder del grupo de consulta del Eje Occidental, propuestas para la Formulación y Diseño de los Indicadores de Gestión para el la Fase de Fortalecimiento del Plan Sistema Tributario Socialista.\r\n\r\nDado que la comunicación para designación de los funcionarios a participar en la consulta, fue recibida el 08/12/2011, último día de plazo para aplicar la consulta en el FORO de la OPP, se presenta la siguiente propuesta, solicitando para un mejor estudio, una extensión del plazo previsto en la comunicación SNAT/OPP/2011/20143 del 02/12/2011.\r\n\r\nEl Archivo con las observaciones se remitió al Lic. Leonardo Chacon, ya que no ha sido posible incrporarlo como adjunto en el este FORO.\r\n\r\nAtentamente.\r\n \r\n\r\nFernando José Jiménez Puche\r\n\r\nÁrea de Planificación y Estadísticas. Región Zuliana.\r\nTeléfono: 0261-7962206 Móvil: 0416-8605617'),
(55, 'Buenos días, siguiendo instrucciones del ciudadano Gerente Regional, Lic. Leonardo Castellano, cumplo con remitir para su consideración como líder del grupo de consulta del Eje Occidental, propuestas para la Formulación y Diseño de los Indicadores de Gestión para el la Fase de Fortalecimiento del Plan Sistema Tributario Socialista.\r\n\r\nDado que la comunicación para designación de los funcionarios a participar en la consulta, fue recibida el 08/12/2011, último día de plazo para aplicar la consulta en el FORO de la OPP, se presenta la siguiente propuesta, solicitando para un mejor estudio, una extensión del plazo previsto en la comunicación SNAT/OPP/2011/20143 del 02/12/2011.\r\n\r\nAtentamente.\r\n\r\n\r\nFernando José Jiménez Puche\r\nÁrea de Planificación y Estadísticas. Región Zuliana.\r\nTeléfono: 0261-7962206 Móvil: 0416-8605617'),
