(67, 'En fecha 22/11/2011 fue conformada la Mesa de Trabajo de Aduanas integrada por funcionarios de la Intendencia Nacional de Aduanas, Gerencia General de Control Aduanero y Tributario, Gerencia de Almacenamiento y Disposición de Bienes Adjudicados, Oficina de Estadística y Estudios Económicos Aduaneros y Tributarios; y de esta Oficina de Planificación y Presupuesto; a fin de presentar las propuestas de indicadores complementarios debidamente argumentados en el marco del Proyecto Sistema Aduanero Socialista.  \r\n \r\nComo resultado de la mesa fueron elaborados las siguientes propuestas de indicadores los cuales se someten a consulta abierta a todas las Gerencias de Aduanas Principales, a fin de recabar observaciones y recomendaciones sobre dicho documento.'),
(68, 'A continuación encontrará cuatro carpetas, contentivas de lo siguiente: \"Presentación de Indicadores de Gestión (Marco legal y conceptual)\"; \"Consideraciones del Sistema Aduanero Socialista\", \"Acerca del Foro de Consulta sobre las Propuestas de Indicadores de Gestión\" y \"Plantilla para incorporación o modificación de indicadores\".\r\n\r\nLos referidos documentos constituyen base de consulta a los fines de revisión de las propuestas de indicadores.'),
(69, 'Buenos tardes.\r\n\r\nSiguiendo instrucciones del ciudadano Gerente Dr. Ricardo Alì Rodriguez, me dirijo a usted en la oportunidad de saludarlo y al mismo tiempo remitir en archivo adjunto, las observaciones realizadas por esta Gerencia a los indicadores Complementarios del Proyecto Sistema tributario socialista.\r\n\r\nSaludos Cordiales\r\n\r\nALEJANDRO ALVARADO\r\nOficina de Planificación\r\nRegión Centro Occidental\r\n0251-2301973'),
(70, 'La Aduana Principal de Ciudad Guayana, conformò el equipo para la revisiòn de los indicadores de gestiòn propuestos y adelanta documentos con las observaciones a l respecto, se le agradece a las dependencias administrativas Aduana Principal de Puerto Ayacucho y Aduana Principal Ecologica de Santa Elena, incorporar las observaciones que consideren pertinentes en este foro a los efectos de iniciar las discuciones a que haya lugar y su posterior consolidacion dentro del documento final que serà enviado a la Oficina de Planificaciòn y presupuesto.\r\n\r\nOtra vìa a travès de la cual pueden ser recibidas las referidas observaciones es por medio de mi correo electronico meperez@seniat.gob.ve, telf 0286-9651616'),
(71, 'BUENOS DIAS.. EN LA ADUANA PRINCIPAL ECOLOGICA DE PUERTO AYACUCHO ESTAMOS ANALIZANDO Y DISCUTIENDO EL CONTENIDO DE LA INFORMACION RELACIONADA CON LOS INDICADORES DE GESTION... EN HORAS DE LA TERDE ESTAREMOS INTERACTUANDO POR ESTE MEDIO.\r\n\r\nMI CORREO DAPERDOM@SENIAT.GOB.VE'),
(72, 'BUENOS DÍAS, EL GRUPO INTEGRADO DE LA ADUANA PRINCIPAL CENTRO OCCIDENTAL, ACORDÓ EL DÍA 13/12 LEER EL DOCUMENTO ACERCA DEL FORO DE CONSULTA SPBRE ÑAS PROPUESTAS DE INIDACDORES DE GESTIÓN. EN LA TARDE DE HOY SE ESTARA ENVIANDO LAS OPINIONES DE LOS PARTICIPANTES.\r\n\r\nGRACIAS'),
(73, 'BUENOS DÍAS EL GRUPO DE LA ADUANA PRINCIPAL CENTRO OCCIDENTAL BAJO LA INFORMACIÓN EN HORAS DE LA TARDE DEL DÍA DE AYER PARA REVISARLO. EN EL DÍA DE HOY EN HORAS DE LA TARDE ESTAREMOS INFORMANDO EL RESULTADO DE LA REVISIÓN.\r\n\r\nGRACIAS'),
(74, 'Muy buenos dias estimados compañeras y compañeros coordinadores y enlaces de planificaciòn y demas funcionarios que comprenden los grupos de consulta de cada una de sus Gerencias, en atenciòn al tiempo establecido para formular las observaciones y recomendaciones pertinentes, estimo necesario para la tarde de hoy 15-12,  poder establecer una comuniciación para definir los posibles puntos afines para no ser repetitivos y ver los particulares de cada Aduana.'),
(75, 'BUENOS DIAS ESTAMOS A LA ESPERA DE LAS OBSERVACIONES Y PROPUESTAS DE ESA ADUANA, PARA POSTERIORMENTE CONSOLIDAR EN UN DOCUMENTO DEFINITIVO'),
(76, 'Muy buenos dias estimados compañeras y compañeros coordinadores y enlaces de planificaciòn y demas funcionarios que comprenden los grupos de consulta de cada una de sus Gerencias, en atenciòn al tiempo establecido para formular las observaciones y recomendaciones pertinentes, estimo necesario para la tarde de hoy 15-12, poder establecer una comuniciación para definir los posibles puntos afines para no ser repetitivos y ver los particulares de cada Aduana.'),
(77, 'BUENOS DIAS ESTAMOS A LA ESPERA DE LAS OBSERVACIONES Y PROPUESTAS DE ESA ADUANA PARA HOY CONSOLIDARLOS EN EL DOCUMENTO DEFINITIVO');
INSERT INTO `jos_kunena_messages_text` (`mesid`, `message`) VALUES
(78, 'INDICADORES DE GESTION – ADUANA PRINCIPAL DE MÉRIDA\r\n\r\nComo resultado de la mesa de trabajo realizada con los jefes de División y Áreas  de la Gerencia de la Aduana Principal de Mérida, se presentan las siguientes observaciones:\r\n\r\nIndicadores asociados al grado de cumplimiento de las metas físicas programadas para las acciones específicas del proyecto: \r\n•	Avance físico del Proyecto (AFPae)\r\nIndicadores asociados a la ejecución de los recursos presupuestarios, asignados para las acciones específicas del proyecto: \r\n•	Ejecución Presupuestaria del Proyecto (EPPae)\r\nIndicadores asociados a la utilización eficiente de los recursos\r\n\r\n•	Volumen de trabajo con respecto a la cantidad de funcionarios dedicados al control inmediato (VT) \r\n\r\nSe debe mantener el indicador\r\n\r\n•	Proporción de funcionarios dedicados al control inmediato, con relación al total de funcionarios dedicados al ejercicio del control (tanto inmediato como posterior) (PFDCI) – \r\n\r\nSe debe mantener el indicador\r\n\r\n\r\n•	Proporción de funcionarios dedicados al control inmediato, con relación al total de funcionarios de la aduana. Se debe mantener el indicador\r\n\r\nIndicadores asociados a la capacidad del servicio para responder en forma rápida y directa a las necesidades de los usuarios. \r\n\r\n•	Tiempo en la recepción de los manifiestos de carga respecto a la fecha de llegada del vehículo de transporte (TPMC). \r\n\r\nEsta es una actividad que es desarrollada exclusivamente por el auxiliar (como almacén), por lo que no tenemos ingerencia directa sobre ello; en consecuencia no debería implementarse como indicador para evaluar la eficiencia y eficacia de la aduana.\r\n\r\n•	Tiempo de permanencia de la carga propiedad del Estado en la zona primaria (TPCE)\r\n\r\nEn este indicador intervienen otros factores (los auxiliares y  los consignatarios), por lo que el tiempo de permanencia de las mercancías no depende exclusivamente de la aduana ya que para evaluar las actividades de la misma, existe un indicador.  \r\n\r\n\r\n•	Tiempo de despacho aduanero (desde la llegada de la mercancía hasta la emisión de pase de salida) (TDA).\r\nConformado por:\r\n	Tiempo transcurrido entre la llegada de la mercancía hasta la descarga en los almacenes. (TDAL)\r\n	Tiempo transcurrido entre la fecha de recepción de la mercancía en los almacenes y la fecha de presentación de la declaración y pago. (TDPA)\r\n	Tiempo transcurrido entre la fecha de la transmisión de la declaración y pago, hasta el momento de la consignación de los documentos en el área de confrontación. (TCFR)\r\n\r\n Los indicadores (TDAL), (TDPA) y (TCFR), tampoco dependen de las acciones efectuadas por la aduana.\r\n\r\n	Tiempo que transcurre entre la fecha de confrontación de los documentos hasta la validación en el reconocimiento. (TREC)\r\n\r\n	Tiempo que transcurrido entre la fecha de validación en el reconocimiento hasta la fecha de emisión del pase de salida del almacén. (TSALM)\r\n\r\nLos indicadores  (TREC) y (TSALM), deben mantenerse, ya son fáciles de comprender y utilizar, se pueden comparar sus valores a largo plazo, son factibles ya que se dispone de la información de manera inmediata, es económico y no genera costos excesivos\r\n\r\n•	Grado de satisfacción de comunidades organizadas formadas respecto a la formación recibida por parte del Servicio Aduanero. (GSC)\r\n\r\nEl indicador es importante para evaluar las actividades de formación desplegado en las comunidades, sin embargo hay duda en cuanto a la manera como se realizara la medición; en tal sentido se sugiere diseñar un instrumento empleando el parámetro de BUENO entre el numero de participantes en la capacitación.\r\n\r\n\r\n•	Grado de satisfacción de los usuarios del servicio en relación al tiempo de despacho aduanero. (GSUS)\r\n\r\nEl indicador como esta planteado no es fácil de utilizar ya que es mas viable para medir el grado de satisfacción el indicador TDA\r\n\r\n\r\nIndicadores asociados a la repercusión a mediano y largo plazo en el entorno social, económico o ambiental de los productos o servicios prestados.\r\n\r\n•	Grado de participación en el control aduanero, de las comunidades organizadas formadas. (GPCOM).\r\n\r\nNo existen observaciones en cuanto a este indicador \r\n\r\n•	Cantidad de hallazgos que se realizan a través de las denuncias efectuadas por parte de las comunidades organizadas (efectividad de las denuncias de las comunidades) (EDEC).\r\n\r\nTomando en cuenta el comportamiento de la comunidad durante el año 2011, en el cual se recibieron denuncias en diferentes materias, se sugiere que este indicador  refiera a todo tipo de denuncias (contrabando, sobreprecios, facturación, maquinas fiscales, etc.) y que sean tomadas en cuenta como acciones especificas.\r\n\r\n•	Grado de cumplimiento voluntario de la normativa aduanera (GCNA).\r\n\r\nEste indicador es viable en su aplicación, con respecto a las mercancías que ingresan a los almacenes autorizados o están a disposición de la autoridad aduanera.\r\n\r\n•	Proporción de las mercancías con decisión de destrucción respecto al total de mercancías en abandono. (PMDD)\r\n\r\n•	Proporción de documentos de transporte de mercancías con decisión de destrucción respecto al total de documentos de transporte de mercancías registrados. (PDTDD).\r\n\r\n\r\nEn relación a los indicadores (PMDD) y (PDTDD) se sugiere unificarlos en proporción a las mercancías en sus diferentes situaciones  legales (comiso y contrabando).\r\n\r\n\r\nOtros Indicadores \r\n\r\n•	Proporción que representan las sanciones de comiso aplicadas respecto al total de sanciones a las infracciones aduaneras (PSC) \r\n\r\nNo hay observaciones en cuanto a este indicador ya que es viable su aplicación.\r\n\r\n•	Grado de confiabilidad de los auxiliares de la administración medido según el promedio de las sanciones aplicadas. (GCAA)\r\n\r\nNo hay observación para este indicador.\r\n\r\n•	Proporción de sanciones por incumplimiento de normas de origen (PSNOR).\r\n\r\nNo hay observación para este indicador.\r\n\r\n•	Proporción de Declaraciones de Aduanas efectivamente investigadas en el control posterior, respecto al total de Declaraciones registradas. (PDAICP)\r\n\r\nNo es competencia de la aduana, ya que corresponde a la Gerencia de Control Posterior.\r\n\r\n•	Cantidad de DUAS objetadas en control posterior respecto a las conformadas en el control inmediato (Hallazgos en Declaraciones Aduaneras sujetas a Reconocimiento)\r\n\r\nNo es competencia de la aduana, ya que corresponde a la Gerencia de Control Posterior.\r\n\r\n•	Ocurrencia de las decisiones de disposición final de mercancías peligrosas en el mismo período que se produjo el abandono. (ODDF)\r\n\r\nNo hay observación para este indicador.\r\n\r\n\r\nSaludos Coordiales'),
(79, 'ADJUNTO LE ENVIO LOS INDICADORES DE GESTIÓN FORMULADO POR EL GRUPO DE LA ADUANA PRINCIPLA CENTRO OCCIDENTAL'),
(80, 'Buenas tardes......\r\n\r\nLuego de analizar la propuesta de los indicadores y aun cuando en esta Gerencia de Aduana no se aplican algunos por no contar con la Herramienta Sidunea. \r\nSe desprende de este analisis que los indicadores propuestos se adaptan a las actividades que se desarrollan en cada una de las Acciones especificas.'),
(81, 'BUENOS DÍAS COMPAÑEROS ES DE MUCHA IMPORTANCIA INDICARLES LA SITUACIÓN QUE PERSONALMENTE PRESENTO, AHORA QUE NUEVAMETE VUELVO A TENER LA RESPONSABILIDAD DE REPRESENTAR A LA OFICINA DE PLANIFICACIÓN Y PRESUPUESTO, LES INDICO QUE POR EL GRAN AVANCE QUE ESTA OFICINA HA PRESENTADO, SE ME HA HECHO DIFICIL ADAPTARME AL RITMO DE TRABAJO DEBIDO A QUE TAMBIÉN CUMPLO LAS FUNCIONES COMO ANALISTA DE REGÍMENES ADUANEROS ESPECIALES, ES POR ELLO, QUE LE SOLICITO FORMALMENTE A LA OPP UNA BREVE AUDIENCIA PARA ACLARAR ALGUNOS PUNTOS ANTES DE FINALIZAR EL AÑO, AUDIENCIA QUE HAGO EXTENSA A TODOS MIS COMPAÑEROS DE LAS OTRAS ADUANAS, LOS QUE TAMBIÉN COMO YO PRESENTEN ALGUNA DUDA. ACTUALMENTE NO CONOCIA EL PLAN DE TRABAJO DE LA OPP Y NO HE LOGRADO CUMPLIR CON LO SOLICITADO DENTRO DEL FORO. PARA AQUELLOS QUE DESEAN COLABORAR DEJO AQUI MI CORREO ELECTRONICO JJBASTID@SENIAT.GOB.VE Y MI NUMERO TELEFONICO 0293.431.28.01 EXT. 9371, CELULAR 0414.016.79.00. MUCHAS GRACIAS POR SU ATENCIÓN'),
(82, 'La Gerencia de la Aduana Principal de Güiria, a través de los funcionarios que conformaron la mesa de trabajo, presentan las observaciones realizadas a la propuesta efectuada por funcionarios adscritos a la Intendencia Nacional de Aduanas, Gerencia General de Control Aduanero y Tributario, Gerencia de Almacenamiento y Disposición de Bienes Adjudicados, Oficina de Estadística y estudios Económicos Aduaneros y Tributarios y de la Oficina de Planificación y Presupuesto:\r\n\r\n\r\n	Tiempo en la recepción de los manifiestos de carga respecto la fecha de llegada del vehículo de transporte (TPMC):\r\n\r\nEl presente indicador no debería implementarse, por motivo que trata de medir la calidad del servicio, y esta es una actividad que depende de los auxiliares de la administración.\r\n\r\n	Tiempo de Permanencia de la Carga del Estado en la Zona Primaria (TPCE):\r\n\r\nEn el presente indicador intervienen los auxiliares de la administración y por tal razón, la permanencia de las mercancías en las zonas primarias no depende únicamente de la Aduana.\r\n\r\n	Tiempo que transcurre entre la fecha de validación en el reconocimiento hasta la fecha de emisión del pase de salida del almacén (TSALM) y Tiempo que transcurre entre la fecha de confrontación de los documentos hasta la validación en el reconocimiento (TREC):\r\n\r\nEstos indicadores están muy bueno, por lo tanto deben mantenerse para la programación.\r\n\r\n	Grado de satisfacción de comunidades organizadas respecto a la formación recibida por parte del Servicio Aduanero (GSC):\r\n\r\nEl indicador esta bien, porque refleja si el trabajo de formación dirigido a las comunidades organizadas se esta realizando de manera que los participantes se sienta agradable con la actividad. Es importante señalar que el rango de valoración debería ser comunidades organizadas formadas / comunidades organizadas formadas satisfechas.\r\n\r\n	Grado de Satisfacción de los usuarios del servicio en relación al tiempo de despacho aduanero (GSUS):\r\n\r\nEsta planteado de una manera fácil de comprender e igualmente de aplicar.  \r\n\r\n	El indicador Eficacia Avance Físico Acciones Especificas en forma general busca medir las actividades programadas de la aduana por las actividades ejecutadas y comprenden uno de los indicadores más importante para el servicio. De esta manera, se debe implementar indicadores más sencillos con sus respectivas denominaciones para que los funcionarios al momento de recargar la información la realicen fácilmente.\r\n\r\n	Ocurrencia de las decisiones de disposición final de mercancías peligrosas en el mismo periodo que se produjo el abandono (ODDF): \r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n\r\n	Ejecución Presupuestaria del Proyecto basado en la ejecución de las acciones específicas (EPPae):\r\n\r\nEste indicador debería quedarse de la siguiente manera: Presupuesto causado (miles de Bolívares) / Presupuesto Asignado a la gerencia. El rango de valoración debe ser Mensual.\r\n\r\n	Grado de participación de las comunidades organizadas formadas por el servicio  aduanero (GPCOM) en el control  aduanero:\r\n\r\nEn este indicador no proponemos ninguna observación ya que la participación en comunidades organizadas formadas fortalece seguridad y soberanía de nuestro país. Debe mantenerse el indicador.\r\n\r\n	Cantidad de hallazgos que se realizan a través de las denuncias efectuadas por parte de las comunidades organizadas (efectividad de las denuncias de las comunidades) (EDEC):\r\n\r\nDebido a que por esta oficina aduanera se reciben denuncias de todas las comunidades que involucran varios factores (maquinas fiscales, facturación, contabilidad de cooperativas, etc.) consideramos que este indicador no debe ser especifico, es decir, control aduanero.\r\n\r\n	Proporción de sanciones por incumplimiento de normas de origen (PSNOR):\r\n\r\nNo hay observaciones para este indicador y es factible.\r\n\r\n\r\n	Grado de cumplimiento voluntario de la normativa aduanera: \r\n\r\nEs factible este indicador aplicado en las operaciones aduaneras en el cumplimiento de las normas por parte de los usuarios de este servicio.\r\n\r\n	Proporción de las mercancías con decisión de destrucción respecto al total de mercancías en abandono (PMDD):\r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n	Proporción de documentos de transporte de mercancías con decisión de destrucción respecto al total de documentos de transporte de mercancías registrados (PDTDD):\r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n	Grado de confiabilidad de los auxiliares de la administración medido según el promedio de las sanciones aplicadas (GCCA):\r\n\r\nEs factible este indicador solo que en la periocidad debe aplicarse cada dos meses.\r\n\r\nEn este orden de ideas, también realizamos algunas observaciones o propuesta generales a los indicadores:\r\n\r\n1.	Una vez que se le de el visto bueno a estos nuevos indicadores de gestión, como seria el proceso para realizar el capitulo Nº 03 correspondiente al Informe de Gestión Mensual.\r\n\r\n2.	Para Cuando se estima comenzar a trabajar con esta nueva propuesta de Indicadores de Gestión.\r\n\r\n3.	Realizar o estructurar un sistema electrónico donde cada gerencia de aduana, por medio del funcionario enlace de la Oficina de Planificación y Presupuesto inserte la información y esta sea enviada automáticamente a las oficinas o gerencias correspondientes.\r\n\r\n\r\n\r\n\r\n¡Independencia y Patria Socialista. Viviremos y Venceremos!'),
(83, 'La Gerencia de la Aduana Principal de Güiria, a través de los funcionarios que conformaron la mesa de trabajo, presentan las observaciones realizadas a la propuesta efectuada por funcionarios adscritos a la Intendencia Nacional de Aduanas, Gerencia General de Control Aduanero y Tributario, Gerencia de Almacenamiento y Disposición de Bienes Adjudicados, Oficina de Estadística y estudios Económicos Aduaneros y Tributarios y de la Oficina de Planificación y Presupuesto:\r\n\r\n\r\n	Tiempo en la recepción de los manifiestos de carga respecto la fecha de llegada del vehículo de transporte (TPMC):\r\n\r\nEl presente indicador no debería implementarse, por motivo que trata de medir la calidad del servicio, y esta es una actividad que depende de los auxiliares de la administración.\r\n\r\n	Tiempo de Permanencia de la Carga del Estado en la Zona Primaria (TPCE):\r\n\r\nEn el presente indicador intervienen los auxiliares de la administración y por tal razón, la permanencia de las mercancías en las zonas primarias no depende únicamente de la Aduana.\r\n\r\n	Tiempo que transcurre entre la fecha de validación en el reconocimiento hasta la fecha de emisión del pase de salida del almacén (TSALM) y Tiempo que transcurre entre la fecha de confrontación de los documentos hasta la validación en el reconocimiento (TREC):\r\n\r\nEstos indicadores están muy bueno, por lo tanto deben mantenerse para la programación.\r\n\r\n	Grado de satisfacción de comunidades organizadas respecto a la formación recibida por parte del Servicio Aduanero (GSC):\r\n\r\nEl indicador esta bien, porque refleja si el trabajo de formación dirigido a las comunidades organizadas se esta realizando de manera que los participantes se sienta agradable con la actividad. Es importante señalar que el rango de valoración debería ser comunidades organizadas formadas / comunidades organizadas formadas satisfechas.\r\n\r\n	Grado de Satisfacción de los usuarios del servicio en relación al tiempo de despacho aduanero (GSUS):\r\n\r\nEsta planteado de una manera fácil de comprender e igualmente de aplicar.  \r\n\r\n	El indicador Eficacia Avance Físico Acciones Especificas en forma general busca medir las actividades programadas de la aduana por las actividades ejecutadas y comprenden uno de los indicadores más importante para el servicio. De esta manera, se debe implementar indicadores más sencillos con sus respectivas denominaciones para que los funcionarios al momento de recargar la información la realicen fácilmente.\r\n\r\n	Ocurrencia de las decisiones de disposición final de mercancías peligrosas en el mismo periodo que se produjo el abandono (ODDF): \r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n\r\n	Ejecución Presupuestaria del Proyecto basado en la ejecución de las acciones específicas (EPPae):\r\n\r\nEste indicador debería quedarse de la siguiente manera: Presupuesto causado (miles de Bolívares) / Presupuesto Asignado a la gerencia. El rango de valoración debe ser Mensual.\r\n\r\n	Grado de participación de las comunidades organizadas formadas por el servicio  aduanero (GPCOM) en el control  aduanero:\r\n\r\nEn este indicador no proponemos ninguna observación ya que la participación en comunidades organizadas formadas fortalece seguridad y soberanía de nuestro país. Debe mantenerse el indicador.\r\n\r\n	Cantidad de hallazgos que se realizan a través de las denuncias efectuadas por parte de las comunidades organizadas (efectividad de las denuncias de las comunidades) (EDEC):\r\n\r\nDebido a que por esta oficina aduanera se reciben denuncias de todas las comunidades que involucran varios factores (maquinas fiscales, facturación, contabilidad de cooperativas, etc.) consideramos que este indicador no debe ser especifico, es decir, control aduanero.\r\n\r\n	Proporción de sanciones por incumplimiento de normas de origen (PSNOR):\r\n\r\nNo hay observaciones para este indicador y es factible.\r\n\r\n\r\n	Grado de cumplimiento voluntario de la normativa aduanera: \r\n\r\nEs factible este indicador aplicado en las operaciones aduaneras en el cumplimiento de las normas por parte de los usuarios de este servicio.\r\n\r\n	Proporción de las mercancías con decisión de destrucción respecto al total de mercancías en abandono (PMDD):\r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n	Proporción de documentos de transporte de mercancías con decisión de destrucción respecto al total de documentos de transporte de mercancías registrados (PDTDD):\r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n	Grado de confiabilidad de los auxiliares de la administración medido según el promedio de las sanciones aplicadas (GCCA):\r\n\r\nEs factible este indicador solo que en la periocidad debe aplicarse cada dos meses.\r\n\r\nEn este orden de ideas, también realizamos algunas observaciones o propuesta generales a los indicadores:\r\n\r\n1.	Una vez que se le de el visto bueno a estos nuevos indicadores de gestión, como seria el proceso para realizar el capitulo Nº 03 correspondiente al Informe de Gestión Mensual.\r\n\r\n2.	Para Cuando se estima comenzar a trabajar con esta nueva propuesta de Indicadores de Gestión.\r\n\r\n3.	Realizar o estructurar un sistema electrónico donde cada gerencia de aduana, por medio del funcionario enlace de la Oficina de Planificación y Presupuesto inserte la información y esta sea enviada automáticamente a las oficinas o gerencias correspondientes.\r\n\r\n\r\n\r\n\r\n¡Independencia y Patria Socialista. Viviremos y Venceremos!'),
(84, 'A CONTINUACION SE DESCRIBEN LAS OBSERVACIONES PUESTO QUE FUE IMPOSIBLE ADJUNTAR LOS ARCHIVOS CORRESPONDIENTES\r\n\r\nEVALUACION DE LOS INDICADORES REALIZADOS POR COORDINACION EJE ORINOCO-APURE \r\n\r\nOBSERVACIONES\r\n	INDICADORES SOBRE LA EFICIENCIA DE LA EJECUCION PRESUPUESTARIA POR ACCIONES ESPECÍFICAS:\r\nLos indicadores de gestión relacionados con la ejecución presupuestaria miden el tanto por ciento del presupuesto ejecutado en el periodo en cuestión, con relación al total del presupuesto aprobado para el ejercicio presupuestario; En tal sentido se plantean las dudas siguientes:\r\nEl PRESUPUESTO MODIFICADO, que se indica como denominador comprende la cantidad mensual estimada del monto total aprobado entre doce meses de manera lineal?\r\nCorresponde al monto mensual programado según el anteproyecto de presupuesto?\r\nO corresponden al monto total del presupuesto en el año con sus correspondientes modificaciones?\r\n	Si fuese el primero de los casos, se observa que el monto no se ajusta necesariamente al gasto que se haya planificado ejecutar en ese período.\r\n	Si fuese el monto programado mensualmente en la formulación del anteproyecto, estaría más ajustado a la realidad y cualquier desvío podrían justificarse en los informes de gestión. Cabe señalar que generalmente el presupuesto sufre cambios cuando se aprueba, en cuyo caso debería solicitarse el ajuste del desembolso mensual programado, y,\r\n	Si fuese el último caso no se entiende como en los primeros meses puede la proporción ser mayor a un 60 % por ejemplo.\r\nAtendiendo a lo anterior y considerando que la causación del gasto a veces puede demorarse debido a factores exógenos a las gestiones emprendidas, esta Aduana sugiere un indicador adicional, cuyo nombre propuesto es GESTIÒN ADMINISTRATIVA PRESUPUESTARIA  y se adjunta en la plantilla modelo más adelante.\r\n\r\n\r\n\r\n\r\n\r\n\r\nARCHIVO: EFICACIA AVANCE FÍSICO ACCIONES ESPECIFICAS.XLS\r\nIndicador: Avance Físico de meta programada de la acción específica “Cobro de Deudas Tributarias”\r\nSe observa que el indicador, está tomando como unidad de medida el acta de intimación y no la cantidad de planilla que corresponden a cada acta.\r\nOcurren situaciones en donde todas las planillas cobradas  a través del acta de intimación no son pagadas en su totalidad sino en forma parcial lo cual no demuestra el 100% de efectividad de la gestión de cobranzas.\r\n\r\nSe destaca que la Aduana Principal de Ciudad de Guayana, el proceso de intimación de Pago, se realiza eventualmente,  puesto utilizamos como mecanismo de cobro,  los lineamientos indicados a través de la circular SNAT/INA/2011-0000841 de fecha 06/10/2011, las totalidad de los  Derechos pendientes pertenecen a organismos públicos, los cuales requieren un tratamiento especial \r\n\r\n \r\nARCHIVO: EFICACIA AVANCE FÍSICO ACCIONES ESPECIFICAS.XLS\r\nINDICADOR: AVANCE FÍSICO DE META PROGRAMADA DE LA ACCIÓN ESPECÍFICA  “REGISTRO DE AUXILIARES ADUANEROS”\r\n\r\nSe considera sobre el indicador, que debe ser tomado en cuenta  en el numerador de la formula, la cantidad de auxiliares aduaneros actualizados más no los autorizados, puesto que la autorización compete a la Intendencia Nacional de Aduanas a través de la Gerencia de Regímenes Aduaneros Especiales, División de Auxiliares Aduaneros. Las Gerencias de Aduana solo se encargan de procesar las solicitudes de Actualización, previo cumplimiento de los requisitos exigidos. \r\n\r\nARCHIVO: EFICACIA2.XLS \r\nINDICADOR: GRADO DE CONFIABILIDAD DE LOS AUXILIARES DE LA ADMINISTRACIÓN MEDIDO SEGÚN EL PROMEDIO DE LAS SANCIONES APLICADAS. (GCAA)\r\n\r\nEste indicador no se comprende por cuanto el denominador está representado por la totalidad de los auxiliares de la circunscripción respectiva y la totalidad de las multas pueden ser interpuestas a solo uno de ellos, por ejemplo.\r\nLo anterior, no mide la confiabilidad de los auxiliares; adicionalmente podemos señalar que muchas de las multas interpuestas a los auxiliares no son imputables  a los mismos sino a las empresas que les prestan sus  servicios. Por ejemplo en esta Aduana, una gran mayoría de las multas obedecen a retrasos en la presentación de la documentación que deben ser entregadas oportunamente por parte de las empresas exportadoras a los auxiliares, a fin de consolidar los manifiestos de carga para su presentación ante la administración aduanera.\r\n\r\n\r\nOBSERVACION DEL AREA DE ALMACENAMIENTO \r\nEn cuanto a los indicadores  propuestos para esta área (archivo IMPACTO.XLS INDICADOR PMDD  y archivo EFICACIA2.XLS INDICADOR ODDF) orientados a la preservación de las condiciones optimas del ambiente en las zonas de almacenes de resguardo de mercancías en abandono y comisos, se consideran apropiados;  es importante incluir los indicadores para las mercancías adjudicadas al fisco y las retenidas con características  perecederas, asimismo se recomienda considerar indicadores de gestión para medir el tiempo utilizado por las diferentes unidades involucradas para la disposición de las mercancías en las situaciones legales tales como: abandono, comisos, adjudicadas al fisco y retenciones u otras que correspondan al resguardo de mercancías con competencia del área de almacenamiento.\r\n\r\nNOTA: LA DIVISION DE OPERACIONES, EL AREA DE ASISTENCIA AL CONTRIBUYENTE, INFORMARON QUE LOS INDICADORES DE GESTION QUE INVOLUCRAN A ESTAS UNIDADES ADMINISTRATIVAS SON FACTIBLES Y DE FACIL APLICACIÓN.\r\nSOBRE LOS INDICADORES QUE INVOLUCRAN AL AREA DE APOYO JURIDICO AUN NO HEMOS RECIBIDO OBSERVACION ALGUNA.\r\n\r\n\r\n\r\nNUEVOS INDICADORES PROPUESTOS\r\n\r\n\r\n\r\n\r\n\r\nIndicadores de Gestión		\r\nSistema Aduanero Socialista		\r\n		\r\n		\r\nNOMBRE DEL INDICADOR	Tiempo en la emisiòn deplanillas complementarias, respecto a la fecha de causaciòn	\r\nFORMULA	TPPC=FCPC-FNPC	\r\n	FCPC=FECHA DE CAUSACIÒN DE PLANILLA COMPLEMENTARIA	\r\n	FNPC=FECHA DE NOTIFICACIÒN DE PLANILLA COMPLEMENTARIA	\r\nTIPO DE INDICADOR	CALIDAD	\r\nUNIDAD DE MEDIDA	DÌAS	\r\nPERIODICIDAD	MENSUAL	\r\nRESPONSABLE	Gerencia de Aduana Principal 	\r\nFUENTE DE INFORMACIÓN	Gerencia de Aduana Principal 	\r\nRANGO DE VALORACIÓN	TPPC < 2	EXCELENTE\r\n	3 <= TPPC = 2	BUENO\r\n	5 <= TLPC > 3	REGULAR\r\n	TLPC > 6	DEFICIENTE\r\nINTERPRETACIÓN DEL INDICADOR	En la medida en que la administraciòn aduanera emita y notifique oportunamente  las planillas complementarias , menor serà el tiempo de desaduanamiento de las mercancias. \r\n\r\n\r\nNOMBRE DEL INDICADOR	Gestiòn Administrativa Presupuestaria	\r\nFORMULA	GAP = PCM / PEGT*100	\r\n	GAP= GESTION ADMINISTRATIVA PRESUPUESTARIA	\r\n	PCM=PRESUPUESTO COMPROMETIDO TRIMESTRAL	\r\n	PEGM=PROYECCCION DE EJECUCION DEL GASTO TRIMESTRAL	\r\nTIPO DE INDICADOR	EFICIENCIA	\r\nUNIDAD DE MEDIDA	Porcentual	\r\nPERIODICIDAD	TRIMESTRAL	\r\nRESPONSABLE	Gerencia de Aduana Principal 	\r\nFUENTE DE INFORMACIÓN	Division de Administracion	\r\nRANGO DE VALORACIÓN	>= 80 GAP <= 100	EXCELENTE\r\n	>= 60 GAP < 80	BUENO\r\n	>= 50 GAP < 60	REGULAR\r\n	 GAP < 50	DEFICIENTE\r\nINTERPRETACIÓN DEL INDICADOR	En la medida en que la gestiòn administrativa presupuestaria de la accion especifica se acerque a la programacion de desembolso estimada, se garantiza el logro del proyecto'),
(85, 'ADUANA PRINCIPAL DE SAN ANTONIO DEL TACHIRA\r\n\r\nINDICADORES DE GESTION\r\n\r\nCONSIDERACIONES GENERALES:\r\n\r\n1.	La Aduana Principal de San Antonio, tiene actualmente cinco (05) Aduanas Subalternas operativas, de las cuales solo la Principal y Subalterna de Ureña, están automatizadas, quedando las Subalternas de Boca del Grita, El Amparo y Aérea de San Antonio, con operaciones manuales. ¿cuales serian para estas tres últimas, los puntos referenciales, fechas o momentos de registro, para determinar los indicadores, si los mismos están en función del Sistema Aduanero Automatizado?  Se debe abarcar este aspecto.\r\n2.	En el actual estado de cosas, el Sistema Aduanero Automatizado, no permite la captura y procesamiento de los factores o variables contenidos en los indicadores, por lo que se requiere diseñar o implementar herramientas gerenciales de procesamiento de la información, dado que en la mayoría de las situaciones se manejarían bases de datos con alimentación manual, lo que haría engorroso y anacrónico con duplicidad de trabajo y datos no muy confiables, o adecuarlos dentro del modulo de consulta del Sidunea, Asy Reports. \r\n3.	en cuanto al indicador “Grado de cumplimiento voluntario de la normativa aduanera”, no se evidencia generación de normas para que se genere un cambio positivo en la cultura de los usuarios del servicio aduanero. Como un caso de ejemplo, en toda la frontera Venezolana – Colombiana, no existe una norma que regule el ingreso y salida de mercancías transportadas por visitantes o residentes fronterizos, generando esta falta de normativa, la aplicación discrecional de la Ley y generando actividades irregulares. Debe preverse un indicador que mida la generación de normas complementarias, mas aun cuando entramos a la etapa de fortalecimiento (2012) donde se deben llevar a cabo actividades de adelantar reformas normativas para hacer factible la obtención previa de información de las mercancías con destino a territorio nacional.\r\n4.	haciendo un conteo en general de los indicadores, los mismos alcanzan el numero de setenta (70), de los cuales, treinta y un (31), incumben directamente a las Aduanas, por ser la fuente de la información. En este sentido, por lo amplia y el manejo de la información, la misma tiende a dispersarse, recomendando en lo posible una reducción, para la incorporación de otros indicadores. Esto en atención a la realidad del servicio aduanero a nivel nacional y no tomando como parámetros solo las aduanas aéreas y marítimas del centro del país.     \r\n\r\nTIPO DE INDICADOR: CALIDAD\r\n\r\n•	Tiempo en la recepción de los manifiestos de carga respecto la fecha de llegada del vehículo de transporte (TPMC)\r\n	\r\nSe debe revisar este indicador, en cuanto a que el mismo no es controlable dentro de la organización, ya que su ejecución depende directamente del transportista.\r\nEn cuanto a la aplicación de la formula, para la Aduana de San Antonio del Táchira, en la mayoría de los casos, el resultado seria cero (0), dada la condición de aduana fronteriza, donde los vehículos que salen de Colombia, trasmiten la información a su salida, llegando en la misma fecha a Venezuela, por lo que el Rango de Valoración estaría en Cero o entre Cero y Cero Nueve Nueve, creándole una valoración a esta Aduana siempre de “BUENO”, por lo que se debería dejar como Rango de Valoración solo las categorías de BUENO para > Cero y DEFICIENTE para < Cero.\r\n. \r\n•	Tiempo de Permanencia de la Carga del Estado en la Zona Primaria (TPCE)\r\n\r\nIndicador no controlable por la Organización, \r\n\r\n•	Tiempo que transcurre entre la fecha de llegada de la mercancía y la fecha de emisión del pase de salida para su retiro de los almacenes (tiempo de despacho aduanero) (TDA)\r\n\r\nTDA = TDAL + TDPA + TCFR + TREC + TSALM      	\r\ndonde:	\r\nTDAL= Tiempo transcurrido entre la llegada de la mercancía y su descarga en almacenes  incluyendo la  localización y relocalización por parte de los transportistas	\r\nTDPA= Tiempo que transcurre entre la fecha de recepción de la mercancía en los almacenes y la fecha de presentación de la declaración y pago (por parte del agente de aduanas)	\r\nTCFR= Tiempo que transcurre entre la fecha de la transmisión de la declaración y pago, hasta el momento de la consignación de los documentos en el área de confrontación.	\r\nTREC= Tiempo que transcurre entre la fecha de confrontación de los documentos hasta la validación en el reconocimiento	\r\nTSALM= Tiempo que transcurre entre la fecha de validación en el reconocimiento hasta la fecha de emisión del pase de salida del almacén	\r\n\r\nEn el caso de los tres primeros supuestos, no depende su ejecución a la Aduana, por lo que mal puede evaluarse la organización en función de otras personas o agentes externos.\r\n\r\nEn el TDAL debería incluirse en el caso de que se mantenga el indicador  el término INGRESO, después de la palabra descarga, quedando de la siguiente manera:\r\nTDAL= Tiempo transcurrido entre la llegada de la mercancía y su descarga  o ingreso en almacenes  incluyendo la  localización y relocalización por parte de los transportistas	\r\nLo anterior, motivado a las características particulares de esta Aduana, por ser fronteriza terrestre, las mercancías objeto de operaciones de comercio exterior, en su mayoría permanecen a bordo de los vehículos  destinados al transponerte de carga internacional por carretera, mientras se perfecciona la operación aduanera.\r\n\r\nEl TDPA, enuncia el tiempo que transcurre entre la fecha de recepción de la mercancía en los almacenes y la fecha de presentación de la declaración y pago (por parte del agente de aduanas), sin embargo, debe revisarse el enunciado ya que establece la presentación de la declaración y pago, como un todo, cosa que no ocurre así, ya que puede darse el pago pero no darse declaración en la misma fecha. Igualmente aplicaría para este indicador la inclusión del término INGRESO, después de la palabra Descarga.\r\n\r\nSe debe unificar las unidades de medida, que en su mayora viene expresada en fechas y TCFR, esta en horas.\r\n\r\nTIPO DE INDICADOR: EFICIENCIA\r\n\r\n•	VT = total de declaraciones registradas/ Número de funcionarios dedicados al control inmediato.\r\nSe observan  incongruencias entre el nombre del indicador, la formula y la interpretación del indicador; el nombre del indicador sugiere que se tome en cuenta el Volumen de trabajo, definiéndose el mismo en la interpretación del indicador, como: la cantidad de documentos de transporte, pero la formula se refiere en general a declaraciones registradas, existiendo una marcada diferencia entre declaración registrada y documentos de transporte, donde la primera abarca la etapa de presentación del documento de transporte.\r\n\r\n•	PFDCI = Funcionarios dedicados al control inmediato / Total de  Funcionarios dedicados al control (inmediato y posterior) * 100\r\nGenera confusión la interpretación del indicador, cuando señala la inclusión de funcionarios de control inmediato  de la Aduana para relacionarlos con el total de funcionarios tanto de control inmediato como posterior.\r\nSe divorcia de la capacidad  operativa y realidad de personal de las Aduanas, no tomando en cuenta  el número de operaciones y de funcionarios disponibles, girando todo en la plantilla de funcionarios tanto de control inmediato como posterior.\r\n\r\nTIPO DE INDICADOR: IMPACTO\r\n\r\n•	Proporción de las mercancías con decisión de destrucción respecto al total de mercancías en abandono (PMDD)\r\n\r\nEn el caso de la Aduana Principal de San Antonio del Táchira, este indicador no tiene mayor relevancia basado solo en mercancías abandonadas, presentando un significativo numero de destrucciones, pero hechas sobre mercancías de procesos administrativos o judiciales por vía de contrabando, por lo que debería ampliarse y modificarse  en cuanto a la extensión de este tipo situación legal, incluyéndose luego de la palabra transporte en la formula, el termino EXPEDIENTES, quedando de la siguiente manera:\r\n\r\nCDTMDD = CANTIDAD DE DOCUMENTOS DE TRANSPORTE O EXPEDIENTES DE MERCANCIAS CON DECISION DE DESTRUCCION 	\r\nTDTMA =  TOTAL DE DOCUMENTOS DE TRANSPORTE DE MERCANCIAS ABANDONADAS O EXPEDIENTES	\r\n\r\n•	Proporción de documentos de transporte de mercancías con decisión de destrucción respecto al total de documentos de transporte de mercancías registrados (PDTDD)\r\n\r\nPara este indicador aplicaría en los mismos términos, la recomendación hecha para el  indicador anterior.'),
(86, 'ADUANA PRINCIPAL DE SAN ANTONIO DEL TACHIRA\r\n\r\nINDICADORES DE GESTION\r\n\r\nCONSIDERACIONES GENERALES:\r\n\r\n1.	La Aduana Principal de San Antonio, tiene actualmente cinco (05) Aduanas Subalternas operativas, de las cuales solo la Principal y Subalterna de Ureña, están automatizadas, quedando las Subalternas de Boca del Grita, El Amparo y Aérea de San Antonio, con operaciones manuales. ¿cuales serian para estas tres últimas, los puntos referenciales, fechas o momentos de registro, para determinar los indicadores, si los mismos están en función del Sistema Aduanero Automatizado?  Se debe abarcar este aspecto.\r\n2.	En el actual estado de cosas, el Sistema Aduanero Automatizado, no permite la captura y procesamiento de los factores o variables contenidos en los indicadores, por lo que se requiere diseñar o implementar herramientas gerenciales de procesamiento de la información, dado que en la mayoría de las situaciones se manejarían bases de datos con alimentación manual, lo que haría engorroso y anacrónico con duplicidad de trabajo y datos no muy confiables, o adecuarlos dentro del modulo de consulta del Sidunea, Asy Reports. \r\n3.	en cuanto al indicador “Grado de cumplimiento voluntario de la normativa aduanera”, no se evidencia generación de normas para que se genere un cambio positivo en la cultura de los usuarios del servicio aduanero. Como un caso de ejemplo, en toda la frontera Venezolana – Colombiana, no existe una norma que regule el ingreso y salida de mercancías transportadas por visitantes o residentes fronterizos, generando esta falta de normativa, la aplicación discrecional de la Ley y generando actividades irregulares. Debe preverse un indicador que mida la generación de normas complementarias, mas aun cuando entramos a la etapa de fortalecimiento (2012) donde se deben llevar a cabo actividades de adelantar reformas normativas para hacer factible la obtención previa de información de las mercancías con destino a territorio nacional.\r\n4.	haciendo un conteo en general de los indicadores, los mismos alcanzan el numero de setenta (70), de los cuales, treinta y un (31), incumben directamente a las Aduanas, por ser la fuente de la información. En este sentido, por lo amplia y el manejo de la información, la misma tiende a dispersarse, recomendando en lo posible una reducción, para la incorporación de otros indicadores. Esto en atención a la realidad del servicio aduanero a nivel nacional y no tomando como parámetros solo las aduanas aéreas y marítimas del centro del país.     \r\n\r\nTIPO DE INDICADOR: CALIDAD\r\n\r\n•	Tiempo en la recepción de los manifiestos de carga respecto la fecha de llegada del vehículo de transporte (TPMC)\r\n	\r\nSe debe revisar este indicador, en cuanto a que el mismo no es controlable dentro de la organización, ya que su ejecución depende directamente del transportista.\r\nEn cuanto a la aplicación de la formula, para la Aduana de San Antonio del Táchira, en la mayoría de los casos, el resultado seria cero (0), dada la condición de aduana fronteriza, donde los vehículos que salen de Colombia, trasmiten la información a su salida, llegando en la misma fecha a Venezuela, por lo que el Rango de Valoración estaría en Cero o entre Cero y Cero Nueve Nueve, creándole una valoración a esta Aduana siempre de “BUENO”, por lo que se debería dejar como Rango de Valoración solo las categorías de BUENO para > Cero y DEFICIENTE para < Cero.\r\n. \r\n•	Tiempo de Permanencia de la Carga del Estado en la Zona Primaria (TPCE)\r\n\r\nIndicador no controlable por la Organización, \r\n\r\n•	Tiempo que transcurre entre la fecha de llegada de la mercancía y la fecha de emisión del pase de salida para su retiro de los almacenes (tiempo de despacho aduanero) (TDA)\r\n\r\nTDA = TDAL + TDPA + TCFR + TREC + TSALM      	\r\ndonde:	\r\nTDAL= Tiempo transcurrido entre la llegada de la mercancía y su descarga en almacenes  incluyendo la  localización y relocalización por parte de los transportistas	\r\nTDPA= Tiempo que transcurre entre la fecha de recepción de la mercancía en los almacenes y la fecha de presentación de la declaración y pago (por parte del agente de aduanas)	\r\nTCFR= Tiempo que transcurre entre la fecha de la transmisión de la declaración y pago, hasta el momento de la consignación de los documentos en el área de confrontación.	\r\nTREC= Tiempo que transcurre entre la fecha de confrontación de los documentos hasta la validación en el reconocimiento	\r\nTSALM= Tiempo que transcurre entre la fecha de validación en el reconocimiento hasta la fecha de emisión del pase de salida del almacén	\r\n\r\nEn el caso de los tres primeros supuestos, no depende su ejecución a la Aduana, por lo que mal puede evaluarse la organización en función de otras personas o agentes externos.\r\n\r\nEn el TDAL debería incluirse en el caso de que se mantenga el indicador  el término INGRESO, después de la palabra descarga, quedando de la siguiente manera:\r\nTDAL= Tiempo transcurrido entre la llegada de la mercancía y su descarga  o ingreso en almacenes  incluyendo la  localización y relocalización por parte de los transportistas	\r\nLo anterior, motivado a las características particulares de esta Aduana, por ser fronteriza terrestre, las mercancías objeto de operaciones de comercio exterior, en su mayoría permanecen a bordo de los vehículos  destinados al transponerte de carga internacional por carretera, mientras se perfecciona la operación aduanera.\r\n\r\nEl TDPA, enuncia el tiempo que transcurre entre la fecha de recepción de la mercancía en los almacenes y la fecha de presentación de la declaración y pago (por parte del agente de aduanas), sin embargo, debe revisarse el enunciado ya que establece la presentación de la declaración y pago, como un todo, cosa que no ocurre así, ya que puede darse el pago pero no darse declaración en la misma fecha. Igualmente aplicaría para este indicador la inclusión del término INGRESO, después de la palabra Descarga.\r\n\r\nSe debe unificar las unidades de medida, que en su mayora viene expresada en fechas y TCFR, esta en horas.\r\n\r\nTIPO DE INDICADOR: EFICIENCIA\r\n\r\n•	VT = total de declaraciones registradas/ Número de funcionarios dedicados al control inmediato.\r\nSe observan  incongruencias entre el nombre del indicador, la formula y la interpretación del indicador; el nombre del indicador sugiere que se tome en cuenta el Volumen de trabajo, definiéndose el mismo en la interpretación del indicador, como: la cantidad de documentos de transporte, pero la formula se refiere en general a declaraciones registradas, existiendo una marcada diferencia entre declaración registrada y documentos de transporte, donde la primera abarca la etapa de presentación del documento de transporte.\r\n\r\n•	PFDCI = Funcionarios dedicados al control inmediato / Total de  Funcionarios dedicados al control (inmediato y posterior) * 100\r\nGenera confusión la interpretación del indicador, cuando señala la inclusión de funcionarios de control inmediato  de la Aduana para relacionarlos con el total de funcionarios tanto de control inmediato como posterior.\r\nSe divorcia de la capacidad  operativa y realidad de personal de las Aduanas, no tomando en cuenta  el número de operaciones y de funcionarios disponibles, girando todo en la plantilla de funcionarios tanto de control inmediato como posterior.\r\n\r\nTIPO DE INDICADOR: IMPACTO\r\n\r\n•	Proporción de las mercancías con decisión de destrucción respecto al total de mercancías en abandono (PMDD)\r\n\r\nEn el caso de la Aduana Principal de San Antonio del Táchira, este indicador no tiene mayor relevancia basado solo en mercancías abandonadas, presentando un significativo numero de destrucciones, pero hechas sobre mercancías de procesos administrativos o judiciales por vía de contrabando, por lo que debería ampliarse y modificarse  en cuanto a la extensión de este tipo situación legal, incluyéndose luego de la palabra transporte en la formula, el termino EXPEDIENTES, quedando de la siguiente manera:\r\n\r\nCDTMDD = CANTIDAD DE DOCUMENTOS DE TRANSPORTE O EXPEDIENTES DE MERCANCIAS CON DECISION DE DESTRUCCION 	\r\nTDTMA =  TOTAL DE DOCUMENTOS DE TRANSPORTE DE MERCANCIAS ABANDONADAS O EXPEDIENTES	\r\n\r\n•	Proporción de documentos de transporte de mercancías con decisión de destrucción respecto al total de documentos de transporte de mercancías registrados (PDTDD)\r\n\r\nPara este indicador aplicaría en los mismos términos, la recomendación hecha para el  indicador anterior.'),
(87, 'Adjunto observaciones sobre los indicadores de la Aduana Aérea de Valencia'),
(88, 'RECOMENDACIONES PUERTO SUCRE'),
(89, 'Al respecto, se analizo que todos los indicadores dispuestos, son importantes para determinar los tiempos que transcurriera en el proceso de desaduanamiento de los bienes, sin embargo es preciso señalar que el Sistema Aduanero Automatizado  SIDUNEA permite determinar los tiempos para los tramites y el control de la llegada, almacenamiento, introducción y permanencia y extracción de las mercancías objeto de trafico internacional.  Este sistema permite de forma expedita manifestar la información señalada por los usuarios de los servicios.  En conclusión el indicador debería basarse en medir el tiempo desde que llega el vehiculo transportador de los bienes hasta que culmina con el desaduanamiento de tales bienes, por cuanto todos los demás indicadores van dirigidos a un mismo fin determinar los tiempos  de permanencia de las mercancías en la zona primaria de las Aduanas.');
INSERT INTO `jos_kunena_messages_text` (`mesid`, `message`) VALUES
(90, 'La Gerencia de la Aduana Principal de Güiria, a través de los funcionarios que conformaron la mesa de trabajo, presentan las observaciones realizadas a la propuesta efectuada por funcionarios adscritos a la Intendencia Nacional de Aduanas, Gerencia General de Control Aduanero y Tributario, Gerencia de Almacenamiento y Disposición de Bienes Adjudicados, Oficina de Estadística y estudios Económicos Aduaneros y Tributarios y de la Oficina de Planificación y Presupuesto:\r\n\r\n\r\n	Tiempo en la recepción de los manifiestos de carga respecto la fecha de llegada del vehículo de transporte (TPMC):\r\n\r\nEl presente indicador no debería implementarse, ya que trata de medir la calidad del servicio, y esta es una actividad que depende de los auxiliares de la administración.\r\n\r\n	Tiempo de Permanencia de la Carga del Estado en la Zona Primaria (TPCE):\r\n\r\nEn el presente indicador intervienen los auxiliares de la administración y por tal razón, la permanencia de las mercancías en las zonas primarias no depende únicamente de la Aduana.\r\n\r\n	Tiempo que transcurre entre la fecha de validación en el reconocimiento hasta la fecha de emisión del pase de salida del almacén (TSALM) y Tiempo que transcurre entre la fecha de confrontación de los documentos hasta la validación en el reconocimiento (TREC):\r\n\r\nEstos indicadores miden acertadamente operaciones y actividades de competencia de la aduana, por lo tanto deben mantenerse para la programación.\r\n\r\n	Grado de satisfacción de comunidades organizadas respecto a la formación recibida por parte del Servicio Aduanero (GSC):\r\n\r\nEl indicador esta bien, porque refleja si el trabajo de formación dirigido a las comunidades organizadas se esta realizando de manera que los participantes se sientan a gusto con la actividad. Es importante señalar que el rango de valoración debería ser comunidades organizadas formadas / comunidades organizadas formadas satisfechas.\r\n\r\n	Grado de Satisfacción de los usuarios del servicio en relación al tiempo de despacho aduanero (GSUS):\r\n\r\nEsta planteado de una manera fácil de comprender e igualmente de aplicar.  \r\n\r\n	El indicador Eficacia Avance Físico Acciones Especificas en forma general busca medir las actividades programadas de la aduana por las actividades ejecutadas y comprenden uno de los indicadores más importante para el servicio. De esta manera, se debe implementar indicadores más sencillos con sus respectivas denominaciones para que los funcionarios al momento de plasmar la información la realicen objetivamente.\r\n\r\n	Ocurrencia de las decisiones de disposición final de mercancías peligrosas en el mismo periodo que se produjo el abandono (ODDF): \r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n\r\n	Ejecución Presupuestaria del Proyecto basado en la ejecución de las acciones específicas (EPPae):\r\n\r\nEste indicador debería quedarse de la siguiente manera: Presupuesto causado (miles de Bolívares) / Presupuesto Asignado a la gerencia. El rango de valoración debe ser Mensual.\r\n\r\n	Grado de participación de las comunidades organizadas formadas por el servicio  aduanero (GPCOM) en el control  aduanero:\r\n\r\nEn este indicador no proponemos ninguna observación ya que la participación en comunidades organizadas formadas fortalece la seguridad y soberanía de nuestro país. Debe mantenerse el indicador.\r\n\r\n	Cantidad de hallazgos que se realizan a través de las denuncias efectuadas por parte de las comunidades organizadas (efectividad de las denuncias de las comunidades) (EDEC):\r\n\r\nDebido a que por esta oficina aduanera se reciben denuncias de todas las comunidades que involucran varios factores (maquinas fiscales, facturación, contabilidad de cooperativas, etc.) consideramos que este indicador no debe ser especifico, es decir, control aduanero.\r\n\r\n	Proporción de sanciones por incumplimiento de normas de origen (PSNOR):\r\n\r\nNo hay observaciones para este indicador y es factible.\r\n\r\n\r\n	Grado de cumplimiento voluntario de la normativa aduanera: \r\n\r\nEs factible este indicador aplicado en las operaciones aduaneras en el cumplimiento de las normas por parte de los usuarios de este servicio.\r\n\r\n	Proporción de las mercancías con decisión de destrucción respecto al total de mercancías en abandono (PMDD):\r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n	Proporción de documentos de transporte de mercancías con decisión de destrucción respecto al total de documentos de transporte de mercancías registrados (PDTDD):\r\n\r\nEs factible este indicador por lo tanto no existe observación.\r\n\r\n	Grado de confiabilidad de los auxiliares de la administración medido según el promedio de las sanciones aplicadas (GCCA):\r\n\r\nEs factible este indicador solo que en la periocidad debe aplicarse cada dos meses.\r\n\r\nEn este orden de ideas, también realizamos algunas observaciones o propuesta generales a los indicadores:\r\n\r\n1.	Una vez que se le de el visto bueno a estos nuevos indicadores de gestión, como seria el proceso para realizar el capitulo Nº 03 correspondiente al Informe de Gestión Mensual.\r\n\r\n2.	Para Cuando se estima comenzar a trabajar con esta nueva propuesta de Indicadores de Gestión.\r\n\r\n3.	Realizar o estructurar un sistema electrónico donde cada gerencia de aduana, por medio del funcionario enlace de la Oficina de Planificación y Presupuesto inserte la información y esta sea enviada automáticamente a las oficinas o gerencias correspondientes.\r\n\r\n\r\n\r\n\r\n¡Independencia y Patria Socialista. Viviremos y Venceremos!'),
(91, 'Aduana Principal Ecológica de Santa Elena de Uairen\r\n\r\n\r\n\r\nLa aduana Principal Ecológica de Santa Elena de Uairen se encuentra ubicada al sur de Venezuela en un eje fronterizo limitando con la republica federativa de Brasil, en virtud de estas situación geográfica esta dirigida a fortalecer la relaciones de comercio internacional con los estados Sur Americanos, tomando en consideración que constituyen una puerta de entrada al Estado Venezolano.\r\nA continuación aremos las observaciones a los siguientes Indicadores de Gestión.\r\n\r\nGCNA: Grado de Cumplimiento Voluntario de la Normativa Aduanera.\r\n\r\nEn este sentido podemos señalar que en esta gerencia de Aduana se cumplen Eficientemente las normas relativas a los procedimientos Aduaneros tanto los funcionarios que laboran en la Aduana como los auxiliares de la administración.\r\nSin embargo no contamos con una norma que rija efectivamente la entrada y salida de mercancías de visitantes y residentes fronterizos, por lo que se hace necesario una renovación de la normativa para aplicar efectivamente un régimen a ese tipo de mercancías.\r\n\r\nPSC: Proporción que representa las sanciones de comiso aplicadas respecto al total de sanciones a las infracciones Aduaneras.\r\n\r\nEn relación a este indicador podemos señalar que las sanciones de comiso aplicadas no corresponden al total de las sanciones por infracciones Aduaneras, pero sin embargo las sanciones con pena de comiso se aplican en mayor proporción con relación a otras sanciones.\r\nEsta situación se produce en virtud de que las mercancías retenidas presentan alguna restricción legal y por lo tanto se presume el  delito de contrabando cuyo órgano competente para conocer es el ministerio público por esta razón dichas mercancías pasan a la orden de este órgano competente, pudiendo solo aplicar las sanción de comiso aquellas mercancías que tienen algún tipo de prohibición cuya sanción puede ser  aplicada por este órgano administrativo.\r\n\r\n Para el Área de Bienes Adjudicado se sugiere la implementación de un indicador de gestión que estandarice las mercancías en las diferentes situaciones legales. \r\n  \r\n Cabe destacar que los demás indicadores que están asignados al plan operativo están acorde con nuestra gestión y se aplican de manera Eficaz y Eficiente.'),
(92, 'OBSERVACIONES DE LA ADUANA PRINCIPAL ECOLÓGICA DE PUERTO AYACUCHO SOBRE LOS INDICADORES PROPUESTOS\r\n\r\nLa Gerencia de Aduana Principal Ecológica de Puerto Ayacucho, una vez revisados todos y cada uno de los indicadores de gestión propuestos, realiza las siguientes observaciones:\r\n\r\nINDICADORES DE CALIDAD:\r\n\r\nTPCE: No aplica por esta aduana ya que los organismos del estado no realizan operaciones a través de la misma.\r\nTDA: Este indicador no es aplicable en nuestra jurisdicción aduanera, en virtud de que no contamos con almacenes ni estructura logística para realizar esta medición.\r\nTDAL: Idem.\r\nTDPA: Idem.\r\nTCFR: No aplica por cuanto no contamos con SIDUNEA.\r\nTSALM: Este indicador no es aplicable en nuestra jurisdicción aduanera, en virtud de que no contamos con almacenes ni estructura logística para realizar esta medición.\r\n\r\nINDICADORES DE IMPACTO\r\nPMDD: Sugerimos que en este indicador en vez de utilizar la formula PMDD= (CDTMDD/TDTMA) *100, sea modificada por PMDD= (CDTMADD/TDTMA) *100\r\nLo cual significa que en vez de tomar como fórmula la cantidad de transporte de mercancía con decisión de destrucción (General), sean consideradas sólo la cantidad de transporte de mercancía abandonada con decisión de destrucción entre el total de documentos de transporte de mercancías abandonadas.\r\n\r\nINDICADORES DE EFICACIA 2\r\nVPOS: No aplica por esta aduana por cuanto no contamos con SIDUNEA.\r\nGCAA: Tenemos dudas respecto al valor de referencia que se indica en el rango de valoración.\r\nPSNOR: No aplica por esta aduana.\r\n\r\nINDICADOR DE EFICIENCIA 2\r\nPDAICP: No aplica por esta aduana por cuanto no contamos con SIDUNEA.\r\nHDASR: No aplica por esta aduana por cuanto no contamos con SIDUNEA.\r\n\r\nLos demás indicadores son aplicables a la gestión de esta Aduana Principal Ecológica.'),
(93, 'Observaciones Aduana Aérea de Maiquetía'),
(94, 'ANALISIS DE LOS INDICADORES DE GESTIÓN PROPUESTOS\r\n\r\n•	La  Aduana Principal de Maracaibo posee cinco aduanas subalternas, de las cuales  las Aduanas Subalternas de La Salina, Puerto Miranda  y El Tablazo, no cuentan  con  SIDUNEA, por lo que sus operaciones se realizan de forma manual o a través de I-SENIAT, relacionadas a que los indicadores están diseñados en función del SIDUNEA, por lo que conviene determinar para estos casos los  momentos de registro  para la determinación de los indicadores.\r\n•	De la revisión de los indicadores propuestos (Calidad), se evidencia que algunos de ellos no son controlables por las aduanas, en virtud de que las actividades consideradas son realizadas por Auxiliares de la Administración Aduanera (Transportistas, Consolidadores, Almacenistas y Agentes de Aduana), como ejemplo de esto, se citan algunos de estos indicadores:\r\n-	Tiempo que transcurre entre la fecha de transmisión de la declaración y pago, hasta el momento de la consignación  de  los documentos en el área de confrontación,\r\n-	Tiempo que transcurre entre la fecha de la llegada de la mercancía y su descarga en los almacenes,  incluyendo la localización y relocalización por parte de los transportistas, consolidadores y almacenes,\r\n-	Tiempo que transcurre entre la fecha de recepción de la mercancía en los almacenes y la fecha de presentación de la declaración y pago (por parte del agente de aduana)\r\n-	Tiempo de recepción de los manifiestos de carga respecto la fecha de llegada del vehículo de transporte,\r\n-	Tiempo de permanencia  de la carga del Estado en la Zona Primaria.\r\nCon respecto al indicador “Tiempo de permanencia  de la carga del Estado en la Zona Primaria “, esta Aduana Principal de Maracaibo a través de la División de Operaciones, mantiene un seguimiento permanente a la carga ingresada al  Puerto de Maracaibo, a la consignación de empresas del Estado, con la finalidad de facilitar el desaduanamiento de las mismas, sin embargo el tiempo de permanencia va a estar determinado por el accionar de dichas empresas y no de la aduana.\r\nConsideramos que dichos indicadores no están asociados a la capacidad del servicio para responder en forma rápida y directa a las necesidades de  los usuarios, y en virtud de lo cual no puede medirse a las oficinas aduaneras por actividades que son enteramente realizadas por un tercero.\r\n•	Del análisis del resto de los indicadores propuestos, consideramos que los mismos cumplen con los aspectos necesarios para implementación y evaluación.\r\n\r\n\r\nSENIAT-ADUANA PRINCIPAL DE MARACAIBO\r\n\r\nPROPUESTA A LOS INDICADORES DE GESTIÓN\r\n\r\nDIVISION DE OPERACIONES\r\nNOMBRE DEL INDICADOR	Grado de confiabilidad del beneficiario del régimen aduanero especial en el cumplimiento del régimen autorizado\r\nFORMULA	GCB= (SABRAE/ TSAIRAE) X 100\r\nSAPBRAE: Sanciones aplicadas al beneficiario del régimen aduanero especial\r\n TSAIRAE: total de sanciones aplicadas por incumplimiento del régimen aduanero especial.\r\nTIPO DE INDICADOR	Eficacia\r\nUNIDAD DE MEDIDA	Cantidad de sanciones aplicadas\r\nPERIODICIDAD	Trimestral\r\nRESPONSABLE	Jefe de la Oficina de Gestión Interna de la Intendencia Nacional de Aduanas.\r\nFUENTE DE INFORMACIÓN	Gerencia de Aduanas Principales\r\nRANGO DE VALORACIÓN	>60 ≤ 100	No confiable\r\n	>20 ≤ 60	Poco confiable\r\n	>0 ≤ 20	Confiable\r\n	0	Muy confiable\r\nJUSTIFICACIÓN  DEL INDICADOR	Este indicador preemitiría medir el cumplimiento del beneficiario de las condiciones bajo las cuales fueron concedidas las autorizaciones de regimenes aduaneros especiales, partiendo de las sanciones aplicadas de conformidad con lo previsto en los artículos 114 y 118 de la ley orgánica de aduanas. este indicador suministrara información que puede ser considerada al momento de la autorización de nuevas autorizaciones al solicitante del régimen.\r\n\r\n\r\n\r\n\r\nAREA DE APOYO JURIDICO\r\n\r\n\r\n-	PODERES, MEDIDOS DE LA SIGUIENTE MANERA:\r\nCantidad de solicitudes de aprobación de Poderes / Cantidad de solicitudes de aprobación de Poderes tramitados\r\nEl documento de Poder, por ser la acción que da inicio a las actividades aduaneras, presentado por el  Agente de Aduanas en representación del consignatario, de conformidad con el articulo 145 del Reglamento de la Ley Orgánica de Aduanas, implica una actividad de gran importancia en el desarrollo de las mismas, ya que sin la aprobación de este, no se activa el proceso aduanero. Para ello, esta Área ha desarrollado e instalado un Sistema de Registro de Poderes, en el cual se incluyen todos aquellos datos necesarios (Nombre del consignatario, C.I., RIF, Agente de Aduanas, Notaria, Tomo y Numero, Fecha, entre otros) para que, una vez revisado y  de ser aprobado emita la Constancia de Aceptación de Poder, y el Reporte de los mismos, que inmediatamente son llevados a la División de Tramitaciones para su inclusión en el SIDUNEA.  Hasta la fecha,  el Área de Apoyo Jurídico ha recibido y a la vez tramitado 2.056 solicitudes. \r\n\r\n-	DECISIONES ADMINISTRATIVAS, MEDIDAS DE LA SIGUIENTE MANERA:\r\n\r\nCantidad de solicitudes presentadas / Cantidad de solicitudes resueltas.\r\n\r\nPor representar una función atribuida en el articulo 122 numeral 3 de la Resolución # 32 sobre la Organización, Atribuciones y  Funciones del SENIAT correspondientes al Área de Apoyo Jurídico, la elaboración de las decisiones administrativas referidas a solicitudes y peticiones que conforme a los procedimientos establecidos en la Ley Orgánica de Aduanas y sus Reglamentos, sean de la competencia del Gerente; es hacia donde se encuentra direccionado uno de los mayores esfuerzos del Área. Para este momento se han recibido 153 solicitudes y peticiones, de las cuales efectivamente tramitadas 129.\r\n\r\nNOTA: POR PROBLEMAS EN LA PLATAFORMA INFORMATICA NO SE PUDO CARGAR EN FORMATO ADJUNTO.');
