(68, 'Simple Image Holder', '', 17, 'left', 0, '0000-00-00 00:00:00', 0, 'mod_sih', 0, 0, 1, '@1=<b>General Settings:</b>\nalign=center\n@2=<b>Image Info (use when holding image files: jpg, png, gif, etc..):</b>\n@3=<b>Flash Info (use when holding flash files: swf):</b>\nquality=high\nloop=Yes\nwmode=window\n@4=<b>Publish by date (Use if you want to publish your file according to dates):</b>\n@5=The date should look like this example: 17-5-2009.\n@6=If you want the (image/flash) to be published periodically, use \'x\' instead of the month or the year, for example, writing: 1-x-2009 as the (start date) will publish the (image/flash) at the first day of every month of 2009, while writing: 14-2-x  will publish the (image/flash) at valentine\'s day every year, writing: 1-x-x will publish the (image/flash) at the start of every month of every year. and the same thing applies for the (end date).\n@7=If you leave a date field empty, it will be considered as (always publish) for example, leaving the (start date) empty and writing a date at the (end date) will publish the (image/flash) until the end date, and vice verca.\n@8=You are using <b>Simple Image Holder Module v1.5.12</b> released on <b>18/12/2009</b> under <b>GNU/GPL</b> License.\n@9=<iframe src=\'http://omar84.com/latest/sih.html\' width=\'100%\' height=\'40\' frameborder=\'0\' scrolling=\'no\'></iframe>\n@10=To get more useful free extensions, visit: <a target=\'_blank\' href=\'http://extensions.joomla.org/extensions/owner/theknight/1\'>The Author\'s JED Page</a>.\n@11=To support this extension, donate at: <a target=\'_blank\' href=\'http://omar84.com/\'>The Author\'s HomePage</a>.\n@12=If you really like this extension, but not enough to donate ;) <br />you can write a small review at: <a target=\'_blank\' href=\'http://extensions.joomla.org/extensions/photos-a-images/images/4889\'>The Extension\'s HomePage</a>.\n@13=If you have any problems or questions regarding this extension, please email me at: admin@omar84.com\n', 0, 0, ''),
(69, 'SAFORPRE', '', 7, 'left', 0, '0000-00-00 00:00:00', 1, 'mod_sih', 0, 0, 0, 'moduleclass_sfx=\nfile=images/stories/SAFORPRE.PNG\nwidth=\nheight=\nalign=center\ntxt1=\ntxt2=\nalt=\nlink=modulos/formulacion/saforpre/\npage=new_page\nopacity=\nopacity2=50\nimg_id=\nname=\nquality=high\nloop=yes\nwmode=window\npubdate=0\npdate=\nudate=\n\n', 0, 0, ''),
